(209, 1105, NULL, '<p><strong>Days months dates</strong></p>\r\n<ol>\r\n<li><strong> Latar Belakang</strong></li>\r\n</ol>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pentingnya memahami penggunaan hari, bulan dan tanggal dalam bahasa Inggris. Sangatlah berperan penting dalam kehidupan sehari-hari bahkan juga dalam dunia pendidikan. hal ini bisa dijadikan sebuah pembelajaran yang sering digunakan oleh semua para kalangan.</p>\r\n<p>Jumlah hari dalam bahasa Inggris sama dengan bahasa Indonesia, yaitu satu minggu terdiri dari tujuh hari. Nama-nama hari dan bulan dalam bahasa Inggris bisa berguna untuk menambah kosakata. Pada nama bulan dalam bahasa Inggris, nama-namanya tidak jauh berbeda dengan nama-nama bulan dalam bahasa Indonesia. Misalnya saja, bulan Januari bahasa Inggrisnya adalah January. Bahkan ada nama bulan yang dalam bahasa Indonesia sama dengan nama bulan dalam bahasa Inggris, yaitu April, September, dan November. Adapun pada tanggal memiliki aturan tersendiri untuk menuliskannya dalam Bahasa Inggris<strong>. </strong>Selain dalam penulisannya, dalam pengucapannya pun sangatlah perlu diperhatikan.</p>', NULL, NULL, '2018-02-21 08:07:29', '2018-02-21 08:07:29'),
