(58, '162', '6', NULL, 'Tanah', 'Tanah merupakan lapisan teratas dari bumi. Tanah terbentuk dari bebatuan yang mengalami pelapukan. Proses pelapukan ini terjadi dalam waktu yang lama bahkan hingga ratusan tahun. Pelapukan batuan menjadi tanah juga dibantu dengan beberapa mikroorganisme, perubahan suhu dan air. .Jenis tanah di indonesia diantaranya adalah tanah aluvial, tanah podsol dan masih banyak lagi yang lainnya.', '20170819-162Untitled 960x540 2017-08-19 02-26-15.mp4', '20170819-jenis jenis tanah.jpg', 'Tanah', 105, 'tanah', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-08-19 14:25:34', '2017-08-19 14:25:34'),
(59, '175', '11', NULL, 'Bunga dan Manfaatnya', 'Bunga adalah alat tubuh tambahan pada tumbuhan dengan berbagai bentuk dan warna. Bunga lengkap tersusun dari enam bagian, yaitu tangkai bunga, dasar bunga, kelopak bunga, mahkota bunga, benang sari dan putik. Kegunaan bunga bagi tumbuhan adalah sebagai alat perkembangbiakan, sedangkan bagi manusia adalah sebagai penghias sudut rumah. ', '20170819-175Tak_berjudul_960x540_2,13Mbps_2017-08-19_00-25-25[1].mp4', '', 'Bunga', 93, 'bunga-dan-manfaatnya', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-08-19 14:25:34', '2017-08-19 14:25:34'),
