(428, '393', '12', NULL, 'Busana Kejawen Gagrag Ngayogyakarta', 'Busana kejawen menika ngewrat saliring pralambang utawi pralampita, utaminipun tumrap tiyang Jawa ingkang asring ngginakaken. Busana kejawen pepak sanget piwulang ingkang sinandi, pepak piwulang - piwulang luhur.', '20171006-393Busana Kejawen Gagrag Ngayogyakarta.mp4', '20171024-kartini.jpg', 'busana, jawa, gagrag yogyakarta', 61, 'busana-kejawen-gagrag-ngayogyakarta', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-06 14:25:36', '2017-10-06 14:25:36');
