(429, '66', '10', NULL, 'N-219 Military', 'N-219 adalah pesawat multi fungsi bermesin dua yang dirancang oleh PT Dirgantara Indonesia (PT DI) dengan tujuan untuk dioperasikan di daerah-daerah terpencil. Pesawat ini terbuat dari logam dan dirancang untuk mengangkut penumpang maupun kargo. Pesawat yang dibuat dengan memenuhi persyaratan FAR 23 ini dirancang memiliki volume kabin terbesar di kelasnya dan pintu fleksibel yang memastikan bahwa pesawat ini bisa dipakai untuk mengangkut penumpang dan juga kargo.\r\n\r\nSebelum memasuki serial production, PT DI terlebih dahulu akan membuat dua unit purwarupa untuk uji terbang serta satu unit purwarupa untuk tes statis pada tahun 2012. Program pembuatan purwarupa sendiri direncanakan memakan waktu selama dua tahun dengan pengalokasian dana yang dibutuhkan sebesar Rp. 300 miliar.[2]\r\n\r\nN-219 akan melakukan uji terbang di laboratorium uji terowongan angin pada bulan Maret 2010. Pesawat N-219 baru akan bisa diserahkan kepada pemesan pertamanya untuk diterbangkan sekitar 2014-2015. N-219 ini merupakan pengembangan dari NC-212 yang sudah diproduksi oleh PT DI dibawah lisensi CASA.', '20171006-66SimplePlanes 2017-10-06 11-13-36-173_x264.mp4', '20171006-n-219.jpg', 'pesawat', 96, 'n-219-military', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-06 14:25:36', '2017-10-06 14:25:36'),
(430, '582', '12', NULL, 'Perkembangan Komunikasi', 'Alat komunikasi adalah semua media yang digunakan untuk menyebarkan atau menyampaikan informasi, baik itu informasi kepada satu orang saja atau kepada banyak orang. Alat komunikasi ini juga bukan hanya menyampaikan informasi saja tetapi juga menghasilkan informasi.', '20171006-582Video_20171006133401840_by_vidcompact.mp4', '20171006-images.jpg', '', 60, 'perkembangan-komunikasi', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-06 14:25:36', '2017-10-06 14:25:36'),
