(441, '66', '12', NULL, 'Pesawat KFX/IFX (Indonesia Fighter Experiment) ', 'Jet tempur KFX/IFX adalah pesawat semi siluman generasi 4.5 yang dikembangkan Korea Selatan dan Indonesia. Kerjasama pengembangan pesawat ini sebatas pada pengembangan pesawat hingga mencapai prototipe. Dari enam prototipe yang akan dihasilkan, satu prototipe akan diserahkan pada Indonesia. Saat ini program Engineering Manufacture Development (EMD) telah menyelesaikan 14 persen dari keseluruhan perencanaan program yang berlangsung hingga 2026.\r\n', '20171009-66ifx fight_x264.mp4', '20171007-ifx stealth.jpg', 'Pesawat Tempur, stealth, n-219 military', 193, 'pesawat-kfxifx-indonesia-fighter-experiment', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-09 14:25:36', '2017-10-09 14:25:36'),
(442, '568', '4', NULL, 'Membuat Grafik Di Microsoft Excel', 'Data pada Grafik lebih mudah dibaca daripada data dalam bentuk uraian.  Disajikan langkah membuat grafik, baik yang datanya berasal dari seluruh tabel maupun data yang hanya berasal dari kolom-kolom tertentu pada tabel.  Juga disajikan jenis-jenis grafik yang ada di Microsoft Excel.', '20171007-568belajar membuat grafik di excel.mp4', '20171008-images.jpg', '#Grafik', 194, 'membuat-grafik-di-microsoft-excel', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-07 14:25:36', '2017-10-07 14:25:36'),
