(524, '626', '2', NULL, 'Tanda Tanda Kiamat ', 'Hari kiamat adalah hari berakhirnya seluruh proses kehidupan makhluk hidup di dunia. Kiamat pasti akan terjadi, tapi tidak seorang pun yang tahu termasu para Nabi dan Rasul kapan akan terjadi. Rasulullah SAW memberitahukan kepada kita beberapa tanda-tanda kiamat, yang disebut dengan tanda-tanda kecil (\"alamat sughra) dan Tanda-tanda besar (\"alamat kubra).Berikut adalah tanda-tanda kiamat kecil (\"alamat sughra) yang sudah terjadi.', '20171022-626TANDA-TANDA KIAMAT.mp4', '', 'Tanda - tanda kiamat', 32, 'tanda-tanda-kiamat', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-22 14:25:36', '2017-10-22 14:25:36'),
(525, '626', '9', NULL, 'Tanda Tanda Kiamat ', 'Hari kiamat atau hari akhir adalah hari berakhirnya seluruh proses kehidupan mahluk hidup di dunia. Hari kiamat pasti akan datang, tetapi tidak ada suatu mahlukpun bahkan para nabi dan rasul pun yang dapat mengetahui kapan datangnya. Tanda-tanda kiamat terbagi atas dua yaitu tanda-tanda kiamat sugro (\'alamatul sugro) dan tanda-tanda kiamat qubra (\'alamatul qubro). Tanda-tanda kiamat sugro sudah nampak, dalam tayangan video ini menunjukkan tanda-tanda kiamat sugro yang terjadi saat ini.', '20171022-626TANDA-TANDA KIAMAT.mp4', '20171022-COVER TANDA TANDA KIAMAT.jpg', 'tanda tanda, kiamat', 68, 'tanda-tanda-kiamat-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-22 14:25:36', '2017-10-22 14:25:36'),
