(538, '66', '13', NULL, 'Pesawat Siluman PD II', 'Pada awal 1930an, Horten bersaudara telah tertarik pada desain sayap terbang sebagai metode untuk meningkatkan kinerja glider. Pemerintah Jerman mendanai klub glider pada saat itu karena produksi pesawat militer dan bahkan pesawat terbang dilarang oleh Perjanjian Versailles setelah Perang Dunia I. Tata letak sayap terbang menghapus permukaan yang \"tidak dibutuhkan\" dan secara teoritis menawarkan bobot serendah mungkin, dengan menggunakan sayap yang relatif pendek dan kokoh, dan tanpa tambahan drag dari badan pesawat. Hasilnya adalah Horten H.IV. \r\n\r\nPada tahun 1943, Reichsmarschall Gring mengeluarkan permintaan untuk proposal desain untuk menghasilkan sebuah bomber yang mampu membawa muatan 1.000 kilogram (2.200 lb) di atas 1.000 kilometer (620 mil) pada jarak 1.000 kilometer per jam (620 mph); apa yang disebut \"proyek 3  1000\". Pembom konvensional Jerman bisa mencapai pusat komando Sekutu di Inggris Raya, namun menderita kerugian yang menghancurkan dari pejuang Sekutu. [3] Pada saat itu, tidak ada cara untuk memenuhi tujuan ini - turbojet Junkers Jumo 004B yang baru dapat memberikan kecepatan yang dibutuhkan, namun memiliki konsumsi bahan bakar yang berlebihan.\r\n\r\nHortens menyimpulkan bahwa desain sayap terbang rendah bisa memenuhi semua tujuan: dengan mengurangi hambatan, daya jelajah dapat diturunkan sampai pada titik di mana persyaratan jangkauan dapat dipenuhi. Mereka mengajukan proyek pribadi mereka, H.IX, sebagai basis pembom. Kementerian Udara Pemerintah (Reichsluftfahrtministerium) menyetujui usulan Horten tersebut, namun memerintahkan penambahan dua meriam 30 mm, karena mereka merasa pesawat terbang juga berguna sebagai pesawat tempur karena perkiraan kecepatan tertinggi lebih tinggi daripada pesawat Sekutu manapun.\r\n\r\nH.IX terbuat dari konstruksi campuran, dengan polong pusat yang terbuat dari pipa baja dilas dan spar sayap yang dibangun dari kayu. Sayap terbuat dari dua panel kayu lapis tipis yang diresapi karbon yang direkatkan dengan campuran arang dan serbuk gergaji. Sayap memiliki satu tiang utama tunggal, ditembus oleh inlet mesin jet, dan tiang sekunder yang digunakan untuk memasang langit-langit. Ini dirancang dengan faktor beban 7g dan rating keamanan 1,8 ; Oleh karena itu, pesawat memiliki rating beban utama 12.6g. Perbandingan chord / ketebalan sayap berkisar antara 15% pada akar sampai 8% pada ujung sayap.  Pesawat tersebut menggunakan landing gear roda tiga yang dapat ditarik, dengan nosegear pada dua prototipe pertama yang bersumber dari sistem tailwheel He 177, dengan prototipe ketiga menggunakan roda gigi dan roda gigi utama 177A pada roda kemudi dan garpu garpu yang dirancang khusus. Sebuah parasut drogue memperlambat pesawat saat mendarat. Pilot duduk di kursi ejeksi primitif. Setelan tekanan khusus dikembangkan oleh Drger. Pesawat ini awalnya dirancang untuk mesin jet BMW 003, namun mesinnya belum siap, dan mesin Junkers Jumo 004 diganti. \r\n\r\nKontrol dicapai dengan elevons dan spoiler. Sistem kontrol mencakup spoiler long-span (inboard) dan short-span (tempel), dengan spoiler tempel yang lebih kecil diaktifkan terlebih dahulu. Sistem ini memberikan kontrol yang lebih halus dan anggun dari yaw daripada sistem single-spoiler. ', '20171025-66horten_0002_x264.mp4', '20171025-horten.jpg', 'stealth, pesawat, pesawat tempur, ', 65, 'pesawat-siluman-pd-ii', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-25 14:25:36', '2017-10-25 14:25:36');
