(539, '909', '9', NULL, 'Penggolongan   Hewan Berdasarkan Jenis Makanannya', 'Hewan dapat  digolongkan berdasarkan jenis makanannya, meliputi :\r\n1. Herbivora adalah jenis hewan yang memakan makanan yang berasal dari tumbuhan. Misalnya sapi, kambing, kelinci, dan sebagainya.\r\n2. Karnivora adalah jenis hewan yang memakan makanan yang berasal dari daging. Misalnya elang, buaya, serigala, dan sebagainya.\r\n3, Omnivora adalah  hewan yang memakan makanan yang berasal dari tumbuhan dan daging. Misalnya ayam, bebek, beruang, dan sebagainya.', '20171025-909Pengholongan Hewan Berdasarkan Makanannya.mp4', '20171026-Video.png', '', 75, 'penggolongan-hewan-berdasarkan-jenis-makanannya', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-25 14:25:36', '2017-10-25 14:25:36'),
