(542, '881', '10', NULL, 'Perbedaan Teks Anekdot dan Humor', 'Video ini diharapkan dapat membantu dalam proses pembelajaran teks anekdot.', '20171027-881Perbedaan Teks Anekdot dan Humor.mp4', '20171027-anekdot.jpg', 'SMKN 3 Metro', 70, 'perbedaan-teks-anekdot-dan-humor', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-27 14:25:36', '2017-10-27 14:25:36'),
(543, '66', '12', NULL, 'Pesawat Terbang Pertama', 'Sejak dahulu banyak orang yang menganggap manusia bisa terbang di udara merupakan hal tidak mungkin dan susah diwujudkan, bahkan banyak yang menertawakan ide tersebut. Namun setelah penemuan pesawat terbang oleh Wright Bersaudara, hal tersebut kemudian menjadi kenyataan.\r\n\r\nAdalah Wright bersaudara (Wright brothers) yang lahir pada tanggal 19 Agustus 1871 dan wafat 30 January 1948 kemudian saudaranya Wilbur yang lahir pada 16 April 1867 dan wafat 30 May 1912 adalah dua orang Amerika yang dicatat dunia  sebagai penemu pesawat terbang.\r\n\r\nMereka berhasil membangun pesawat terbang yang pertama kali berhasil diterbangkan dan dikendalikan oleh manusia pada tanggal 17 Desember 1903. Dua tahun setelah penemuan mereka, kedua bersaudara tersebut mengembangkan mesin terbang mereka ke bentuk pesawat terbang yang memakai sayap yang seperti sekarang kita kenal.', '20171027-66SimplePlanes 2017-10-27 16-26-47-391_x264.mp4', '20171027-wright plane.jpg', 'pesawat ', 53, 'pesawat-terbang-pertama', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-27 14:25:36', '2017-10-27 14:25:36'),
(544, '66', '7', NULL, 'Pesawat Tempur pertama (RAF F.E.2b)', 'The Airco DH.2 adalah pesawat \"pendorong\" biplan satu kursi yang dioperasikan sebagai pejuang selama Perang Dunia Pertama. Itu adalah desain pendorong kedua oleh Geoffrey de Havilland untuk Airco, berdasarkan pada sebelumnya DH.1 dua tempat duduknya. DH.2 adalah pesawat tempur single-seat pertama yang dipersenjatai secara efektif dan memungkinkan pilot Royal Flying Corps (RFC) untuk melawan \"Fokker Scourge\" yang telah memberi Jerman keuntungan di udara pada akhir 1915. Sampai Inggris mengembangkan sebuah sinkronisasi Peralatan yang sesuai dengan sistem Jerman, alat pengantar seperti DH.2 dan FE2b menanggung beban pertempuran dan tugas pendamping.', '20171027-66SimplePlanes 2017-10-27 20-11-39-419_x264.mp4', '20171027-pesawat tempur pertama.jpg', 'pesawat, pesawat tempur, pesawat biplane', 50, 'pesawat-tempur-pertama-raf-fe2b', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-27 14:25:36', '2017-10-27 14:25:36'),
(545, '66', '13', NULL, 'Pesawat Triplane (Red Baron)', 'Pada awalnya pesawat digunakan untuk mengintai posisi lawan di garis depan serta kepentingan komunikasi, karena sering berpapasan dengan pesawat lawan, maka pilot menggunakan pistol atau senapan untuk saling menembak. Kemudian pesawat dilengkapi dengan senapan mesin dan penembak (gunner) yang ditempatkan di belakang pilot. Posisi gunner sendiri pada awanya ada yang berkemampuan untuk menembak pesawat musuh dibelakangnya, atau didepannya.\r\n\r\nAdalah Roland Garros, seorang penerbang Perancis yang membuat pesawat tempur yang dilengkapi senapan mesin langsung dikendalikan oleh pilot sehingga hanya dibutuhkan satu penerbang saja. Mulanya dipasang senapan mesin pada kokpit pesawat Morane Saulnier. Kemudian digunakan untuk menembaki pesawat pesawat Jerman. Pilot-pilot Jerman terkejut karena saat itu baru pertama kali ada pesawat tempur dapat menyerang dari belakang pesawat lawan dengan satu orang pilot. Masalah muncul pada Roland Garros karena peluru mengenai baling baling dan dapat menghancurkannya. Untuk itu digunakan lapisan pelat baja pada baling balingnya. Selanjutnya digunakan alat Sincronize yakni alat yang dapat membuat antara putaran baling baling pesawat sinkron dengan penembakan senapan mesin sehingga peluru mencecar melewati celah baling-balingnya.\r\n\r\nKemudian bentuk dan teknis pesawat diperbaiki meskipun pada umumnya pesawat tersebut masih terbuat dari kayu. Umumnya pesawat pesawat tersebut menggunakan mesin radial sehingga tidak dilengkapi dengan antifreeze (anti beku) sehingga mesin pesawat harus dibersihkan dari cairan baik pelumas ataupun bahan bakar. Muncullah rancangan rancangan yang dikenal pada zamannya seperti Triplane (Pesawat dengan sayap bersusun tiga), Biplane (pesawat dengan sayap bersusun dua). Ataupun pesawat berukuran raksasa untuk pembom seperti Ilya Muromet\'s (Rusia).\r\n\r\nPada Generasi ini dikenal pesawat-pesawat Fokker, Sopwith Camel, Gotha (bomber) dan lain lain dengan pernerbang penerbang seperti Baron von Richthofen, Manfred von Richthoven (Jerman) dan lain lain.', '20171027-66SimplePlanes 2017-10-27 20-19-08-127_x264.mp4', '20171027-triplane.jpg', 'pesawat tempur, perang dunia I. ', 36, 'pesawat-triplane-red-baron', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-27 14:25:36', '2017-10-27 14:25:36'),
(546, '66', '3', NULL, 'Pesawat Biplane (Sopwith Camel)', 'Pada awalnya pesawat digunakan untuk mengintai posisi lawan di garis depan serta kepentingan komunikasi, karena sering berpapasan dengan pesawat lawan, maka pilot menggunakan pistol atau senapan untuk saling menembak. Kemudian pesawat dilengkapi dengan senapan mesin dan penembak (gunner) yang ditempatkan di belakang pilot. Posisi gunner sendiri pada awanya ada yang berkemampuan untuk menembak pesawat musuh dibelakangnya, atau didepannya.\r\n\r\nAdalah Roland Garros, seorang penerbang Perancis yang membuat pesawat tempur yang dilengkapi senapan mesin langsung dikendalikan oleh pilot sehingga hanya dibutuhkan satu penerbang saja. Mulanya dipasang senapan mesin pada kokpit pesawat Morane Saulnier. Kemudian digunakan untuk menembaki pesawat pesawat Jerman. Pilot-pilot Jerman terkejut karena saat itu baru pertama kali ada pesawat tempur dapat menyerang dari belakang pesawat lawan dengan satu orang pilot. Masalah muncul pada Roland Garros karena peluru mengenai baling baling dan dapat menghancurkannya. Untuk itu digunakan lapisan pelat baja pada baling balingnya. Selanjutnya digunakan alat Sincronize yakni alat yang dapat membuat antara putaran baling baling pesawat sinkron dengan penembakan senapan mesin sehingga peluru mencecar melewati celah baling-balingnya.\r\n\r\nKemudian bentuk dan teknis pesawat diperbaiki meskipun pada umumnya pesawat tersebut masih terbuat dari kayu. Umumnya pesawat pesawat tersebut menggunakan mesin radial sehingga tidak dilengkapi dengan antifreeze (anti beku) sehingga mesin pesawat harus dibersihkan dari cairan baik pelumas ataupun bahan bakar. Muncullah rancangan rancangan yang dikenal pada zamannya seperti Triplane (Pesawat dengan sayap bersusun tiga), Biplane (pesawat dengan sayap bersusun dua). Ataupun pesawat berukuran raksasa untuk pembom seperti Ilya Muromet\'s (Rusia).\r\n\r\nPada Generasi ini dikenal pesawat-pesawat Fokker, Sopwith Camel, Gotha (bomber) dan lain lain dengan pernerbang penerbang seperti Baron von Richthofen, Manfred von Richthoven (Jerman) dan lain lain.', '20171027-66SimplePlanes 2017-10-27 20-24-42-112_x264.mp4', '20171027-biplane.jpg', 'Pesawat Tempur, Perang Dunia I, ww1', 37, 'pesawat-biplane-sopwith-camel', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-27 14:25:36', '2017-10-27 14:25:36'),
(547, '66', '1', NULL, 'Pesawat Low Wings (ME- Bf 109)', 'Pada masa Perang Dunia II, bentuk pesawat mengalami perubahan yang lebih jauh daripada era sebelumnya. Perubahan itu diantaranya meliputi, bahan yang digunakan, desain pesawat, mesin pesawat, cokpit serta dilengkapi dengan sistem radio bahkan ada yang dilengkapi radar. perubahan tersebut seiring dengan perkembangan teknologi pada masa itu misalnya radar pada sistem pertahanan melengkapi lampu sorot (search light) yang dapat mencium jejak pesawat lawan pada jarak yang jauh serta berbagai cuaca dan waktu. Mesin pesawat yang tidak lagi menggunakan bentuk radial serta dilengkapi dengan sistem injeksi bahan bakar seperti Messerschmit yang memungkinkan pesawat dapat bergerak lebih lincah serta dapat distarter langsung dari kokpit tanpa bantuan staf darat. Bahkan menjelang akhir perang mulai diluncurkannya pesawat bermesin jet seperti Gloster Meteor dan Messerschmitt Me-262. Bahan pesawat yang terbuat dari metal sekalipun penemuan radar membuat pesawat tersebut mudah diketahui pihak lawan. Desain pesawat yang lebih ramping streamline terlebih-lebih menjelang akhir perang.\r\n\r\nDari sistem senjata selain dilengkapi senapan mesin baik kaliber 7,7 mm, 12,7 mm, sampai 20 mm bahkan ada yang dilengkapi roket seperti halnya P-51 Mustang dan Me-262.\r\n\r\nPada saat ini juga digunakannya pesawat tempur yang diluncurkan dari Kapal Induk meskipun diperkenalkan oleh Angkatan Laut Inggris pertama kali pada tahun 1912. Terlebih lebih di medan pasifik dimana pertempuran lebih banyak terjadi di lautan antara Jepang dengan Amerika.\r\n\r\nPada masa ini dikenal pesawat seperti Messerschmit Bf 109, Focke Wolf (Jerman) , Spitfire, Hurricane (Inggris), P-51 Mustang, P-38 Lightning (USA), Mitsubishi A6M2 Zero, Hayabusha (Jepang). Lavochkin, Sturmovik (Rusia). Serta mengenal jagoan-jagoan (The Aces) di udara diantaranya Mayor Eritch Hartmann (Jagoan dari segala jagoan, lebih dari 300 pesawat lawan dijatuhkan, dari Jerman), Peltu Hiroshi Nishizawa, Saburo Sakai, Ohta (Jepang).', '20171027-66SimplePlanes 2017-10-27 20-35-31-624_x264.mp4', '20171027-monoplane.jpg', 'pesawat tempur, perang dunia II, ', 36, 'pesawat-low-wings-me-bf-109', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-27 14:25:36', '2017-10-27 14:25:36'),
(548, '66', '7', NULL, 'Pesawat Jet Pertama (ME-262)', 'Pada masa Perang Dunia II, bentuk pesawat mengalami perubahan yang lebih jauh daripada era sebelumnya. Perubahan itu diantaranya meliputi, bahan yang digunakan, desain pesawat, mesin pesawat, cokpit serta dilengkapi dengan sistem radio bahkan ada yang dilengkapi radar. perubahan tersebut seiring dengan perkembangan teknologi pada masa itu misalnya radar pada sistem pertahanan melengkapi lampu sorot (search light) yang dapat mencium jejak pesawat lawan pada jarak yang jauh serta berbagai cuaca dan waktu. Mesin pesawat yang tidak lagi menggunakan bentuk radial serta dilengkapi dengan sistem injeksi bahan bakar seperti Messerschmit yang memungkinkan pesawat dapat bergerak lebih lincah serta dapat distarter langsung dari kokpit tanpa bantuan staf darat. Bahkan menjelang akhir perang mulai diluncurkannya pesawat bermesin jet seperti Gloster Meteor dan Messerschmitt Me-262. Bahan pesawat yang terbuat dari metal sekalipun penemuan radar membuat pesawat tersebut mudah diketahui pihak lawan. Desain pesawat yang lebih ramping streamline terlebih-lebih menjelang akhir perang.\r\n\r\nDari sistem senjata selain dilengkapi senapan mesin baik kaliber 7,7 mm, 12,7 mm, sampai 20 mm bahkan ada yang dilengkapi roket seperti halnya P-51 Mustang dan Me-262.\r\n\r\nPada saat ini juga digunakannya pesawat tempur yang diluncurkan dari Kapal Induk meskipun diperkenalkan oleh Angkatan Laut Inggris pertama kali pada tahun 1912. Terlebih lebih di medan pasifik dimana pertempuran lebih banyak terjadi di lautan antara Jepang dengan Amerika.\r\n\r\nPada masa ini dikenal pesawat seperti Messerschmit Bf 109, Focke Wolf (Jerman) , Spitfire, Hurricane (Inggris), P-51 Mustang, P-38 Lightning (USA), Mitsubishi A6M2 Zero, Hayabusha (Jepang). Lavochkin, Sturmovik (Rusia). Serta mengenal jagoan-jagoan (The Aces) di udara diantaranya Mayor Eritch Hartmann (Jagoan dari segala jagoan, lebih dari 300 pesawat lawan dijatuhkan, dari Jerman), Peltu Hiroshi Nishizawa, Saburo Sakai, Ohta (Jepang).', '20171027-66SimplePlanes 2017-10-27 20-44-54-682_x264.mp4', '20171027-jet pertama.jpg', 'pesawat tempur, jet, perang dunia I, ', 52, 'pesawat-jet-pertama-me-262', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-27 14:25:36', '2017-10-27 14:25:36'),
(549, '66', '11', NULL, 'Pesawat Monoplane (Fokker D.VII)', 'Pada awal 1918, Fokker memproduksi beberapa prototip monoplane bertenaga rotari. Dari jumlah tersebut, Fokker menyerahkan V.26 dan V.28, monoplane bersayap tinggi dengan badan tabung baja biasa, untuk percobaan tempur kedua di Adlershof pada bulan Mei / Juni 1918. V.28 diuji dengan 108 kW (145 hp) Oberursel UR.III dan 119 kW (160 hp) Goebel Goe.III, meski kedua mesin ini belum siap untuk layanan operasional. V.26 menggunakan mesin Oberursel UR.II standar, yang menghasilkan hanya 82 kW (110 hp). Sementara mesin ini sudah usang, daya tarik dan ringan V.26 yang rendah berarti cukup cepat. Desain Fokker baru saja dihantam oleh Siemens-Schuckert D.III dengan mesin bi-rotary Siemens-Halske Sh.III yang kompleks.\r\n\r\nPada akhirnya, V.26 diperintahkan untuk diproduksi sebagai Fokker E.V. Empat ratus orang diperintahkan segera dengan baik UR.III atau Goe.III. Karena mesin tidak tersedia dalam jumlah apapun, semua contoh produksi dipasang di UR.II.', '20171028-66SimplePlanes 2017-10-28 10-25-04-977_x264.mp4', '20171028-monoplane hi.jpg', 'pesawat, pesawat tempur, monoplane, high wings', 40, 'pesawat-monoplane-fokker-dvii', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-10-28 14:25:36', '2017-10-28 14:25:36'),
