(582, '1053', '13', NULL, 'Buah Pala', 'Buah pala berasal dari banda, maluku. pala juga banyak ditemukan di fakfak papua barat.\r\nBuah pala terdiri dari daging,biji, bunga yang menutupi biji (fuli), serta biji itu sendiri yang disebut pala.\r\nBuah pala banyak manfaatnya diantaranya kulit dagingnya diolah menjadi manisan, sirup pala, bijinya (pala itu sendiri)  sebagai bumbu sayuran, kue, serta minyaknya digunakan sebagai parfum.\r\n', '20171101-1053VID-20171101-WA0012[1].mp4', '20171101-buah pala.jpg', 'buah_pala', 70, 'buah-pala', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-01 14:25:36', '2017-11-01 14:25:36'),
