(596, '1088', '10', NULL, 'Candi Peninggalan Kerajaan Majapahit', 'Candi-Candi Peninggalan Kerajaan Majapahit  Majapahit adalah sebuah kerajaan yang berpusat di Jawa Timur, Indonesia, yang pernah berdiri dari sekitar tahun 1293 hingga 1500 M. Kerajaan ini mencapai puncak kejayaannya menjadi kemaharajaan raya yang menguasai wilayah yang luas di Nusantara pada masa kekuasaan Hayam Wuruk, yang berkuasa dari tahun 1350 hingga 1389.\r\n\r\nKerajaan Majapahit adalah kerajaan Hindu-Buddha terakhir yang menguasai Nusantara dan dianggap sebagai salah satu dari negara terbesar dalam sejarah Indonesia. Tak heran jika Majapahit meninggalkan banyak peninggalan Bangunan serta candi seperti yang berikut ini.\r\nCandi Sukuh, Candi Cetho, Candi Pari, Candi Jabung, Gapura Bajang Ratu, Candi Brahu, Candi Tikus, Candi Surawana, Candi Wringin Branjang', '20171101-108810 Candi Peninggalan Kerajaan Majapahit Yang Menarik.mp4', NULL, 'Majapahit, Candi, Hindu-Budha', 41, 'candi-peninggalan-kerajaan-majapahit', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-01 14:25:36', '2017-11-01 14:25:36'),
