(604, '1029', '13', NULL, 'Kenampakan Alam di Indonesia', 'Kenampakan alam adalah segala sesuatu yang nampak di permukaan bagian bumi atau alam. Permukaan bumi terdiri dari daratan dan perairan. Seperti gunung, hutan, sungai, pelabuhan, bandara d.l.l', '20171101-1029Untitled 640x360 0.94Mbps 2017-11-01 07-02-36.mp4', '20171101-IMG-20171101-WA0037.jpg', 'Kenampakan Alam di Indonesia. By Ahmad Wahyudi. SDN SAHAREY FAKFAK TIMUR', 47, 'kenampakan-alam-di-indonesia-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-01 14:25:36', '2017-11-01 14:25:36'),
(605, '1043', '10', NULL, 'PENGUASAAN MEDIA TEKNOLOGI', 'Penguasaan teknologi informatika bagi guru sangatlah penting. Sebab dengan menguasai TIK maka seorang guru dapat mempersiapkan mediA pembelajaran yang bervariasi dan menyenangkan. Misalnya menggunakan media pembelajaran lewat video, dengan demikian secara langsung siswa diajak untuk berperan aktif.', '20171102-1043Untitled 1 640x480 2017-11-01 10-27-41.mp4', NULL, '', 32, 'penguasaan-media-teknologi', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-02 14:25:36', '2017-11-02 14:25:36'),
(606, '1073', '10', NULL, 'KIT Hand Made Berbahan Limbah', 'Para guru IPA ketika mengajar biasanya  hanya menampilkan media pembelajaran atau KIT IPA yang tersedia di laboratorium. Ditinjau dari kemajuan infrastruktur sekolah, hal ini mengindikasikan bahwa ketersediaan KIT IPA semakin lengkap di setiap sekolah. Lantas, bagaimana apabila KIT IPA tidak tersedia di laboratorium ? Padahal, sebuah konsep yang abstrak tidak cukup dibelajarkan hanya dengan medote ceramah? Alternatif solusinya, adalah KIT Hand Made (KIT buatan tangan/buatan sendiri). Terlepas dari kondisi kelengkapan fasilitas laboratorium IPA, pendidikan hendaknya dapat terus diselenggarakan tanpa harus menunggu lengkapnya fasilitas. Oleh karena itu untuk menjaga kelangsungan pendidikan IPA melalui praktikum/eksperimen, perlu dikembangkan alternatif alat peraga-praktik IPA yaitu alat peraga-pratik sederhana (buatan sendiri) agar pembelajaran IPA dapat berjalan secara optimal. Hal tersebut penting  bagi guru/sekolah dengan alasan sebagai berikut; Pertama, alat peraga-pratik IPA sederhana sebagai upaya melengkapi peralatan yang dibutuhkan dalam pembelajaran. Para guru dapat memberdayakan berbagai sumber daya yang ada di sekitar sekolah dan tempat tinggal peserta didik untuk pengembangan alat peraga praktik IPA sederhana. Kedua, alat peraga-pratik IPA sederhana ini dapat dijadikan sebagai alternatif peralatan laboratorium; meningkatkan kreativitas guru dan peserta didik; sebagai upaya meragamkan sumber belajar peserta didik; agar peserta didik dapat membangun pengetahuan dan keterampilan serta sikap yang sesuai dengan kompetensi yang disarankan dalam kurikulum. (Kemdikbud:2011). Permasalahan limbah sudah menjadi masalah global yang pelik, sehingga perlu adanya inisiatif untuk mengatasinya. Salah satunya, memanfaatkan limbah menjadi bahan pembuatan KIT IPA. Limbah adalah buangan atau sisa yang dihasilkan dari suatu proses atau kegiatan dari industri maupun domestik (rumah tangga). Apabila para siswa terbiasa dengan peralatan standar KIT IPA yang tersedia di laboratorium, mental konseptual secara perlahan akan terbentuk dan mematikan cara berpikir kreatif.  Dengan kata lain, akan tertanam dalam alam pikiran siswa, jika tidak tersedia peralatan standar KIT IPA maka eksperimen IPA tidak dapat berlangsung. Idealnya, disamping menggunakan KIT IPA standar laboratorium, guru semestinya juga mengajak para siswa untuk berpikir kreatif, dengan memancing mereka dengan pertanyaan-pertanyaan, antara lain; sambil menunjukkan salah satu  KIT IPA, guru melontarkan pertanyaan, Mungkinkah alat ini dapat kita buat sendiri dari limbah  yang ada di sekitar kita? Apakah kalian mempunyai ide agar alat ini menjadi lebih sempurna? Misalnya, untuk materi cara kerja lensa mata memfokuskan bayangan di retina. Biasanya, guru hanya menampilkan torso dan gambar mata, sedangkan proses menebal dan memipihnya lensa mata hanya disampaikan secara verbal. Hanya sampai disitukah penjelasan guru tentang cara kerja lensa mata? Mengacu pada strategi pembelajaran berbasis CTL (Contextual Teaching and Learning), sebaiknya guru mencoba menggali ide-ide dari para siswa. Diawali diskusi klasikal antara guru dengan siswa, kemudian bersama-sama mencoba merancang alat praktik lensa mata yang dapat dikondisikan menebal dan memipih. Bahan-bahannya diambil dari barang-barang yang sudah tidak terpakai/sisa/sampah, misalnya paralon sisa, balon karet, alat suntik tinta printer, sedotan aqua gelas, kotak kardus, dan lain-lain. Disamping menanamkan kreativitas, akan tumbuh arti penting mengelola limbah berbasis Reuse-Reduce-Recycle (3R). Efek jangka panjang, mental kreatif yang tertanam dalam diri para siswa akan menjadi sense of lifeskill yang akan menjadi fondasi kehidupannya kelak melalui kreativitas vokasional, pembelajaran yang berkualitas, serta merangsang ide dalam pemanfaatan limbah. ', '20171102-1073KIT Hand Made Berbahan Limbah_x264.mp4', '20171102-ft pus.jpg', 'KIT Hand Made Eko', 52, 'kit-hand-made-berbahan-limbah', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-02 14:25:36', '2017-11-02 14:25:36'),
