(622, '1031', '6', NULL, 'The Elephant ', 'An Elephant is the largest and strongest of all animals. It is a strange looking animal which it has thick legs, huge sides and backs, large hanging ears, a small tail, little eyes, long white tusk and above all, elephant has a long nose, the trunk. An Elephant is commonly seen in a zoo,it has hard found in it natural habitat. The Elephant is very intelligent animal. Its intelligence combined with its great strength make an elephant a very useful servant to man. An Elephant is really a smart animal. ', '20171102-1031VID-20171102-WA0000.mp4', '20171113-fauna.jpg', 'Elephant ', 50, 'the-elephant', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-02 14:25:36', '2017-11-02 14:25:36'),
(623, '998', '12', NULL, 'MANFAAT BUAH SEMANGKA', 'Ada beberapa manfaat buah semangka, yaitu:\r\n1. Mengontrol tekanan darah tinggi\r\n2. Mengurangi lemak berlebih\r\n3. Menjaga tubuh tetap terhidrasi\r\n4. Menjaga kesehatan mata\r\n5. Menjaga kesehatan ginjal\r\n6. Menjaga kesehatan jantung\r\n7. Melawan kanker\r\n8. Memberi energi\r\n8. Mencegah dan mengobati diabetes', '20171102-998Video_20171102221707552_by_vidcompact.mp4', '20171102-Screenshot_2017-11-01-22-38-51-1.png', '', 57, 'manfaat-buah-semangka', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-02 14:25:36', '2017-11-02 14:25:36'),
(624, '1029', '1', NULL, 'Kenampakan Alam di Indonesia', 'Kenampakan alam adalah segala sesuatu yang nampak di permukaan bagian bumi atau alam. Permukaan bumi terdiri dari daratan dan perairan. Misalnya gunung, hutan, sungai, pelabuhan, bandara d.l.l ', '20171103-1029Untitled 640x360 0.94Mbps 2017-11-01 07-02-36.mp4', '20171103-images-24.jpeg', 'Kenampakan Alam di Indonesia. By Ahmad Wahyudi. SDN SAHAREY FAKFAK TIMUR', 58, 'kenampakan-alam-di-indonesia-3', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36');
