(625, '1043', '1', NULL, 'PENGUASAAN MEDIA TEKNOLOGI', 'Penguasaan ilmu pengetahuan teknologi sangatlah diharapkan diera modern dewasa ini. Penguasaan IPTEK khususnya TIK yang baik akan mempermudah seseorang dalam melakukan segala keperluan dengan mudah lewat dunia internet. Penguasaan internet sangat diharapkan bagi seorang guru sehingga membantu guru dalam menunjang kelancaran proses belajar mengajar. Dengan menggunakan berbagai media pembelajaran yang bervariasi akan menciptakan suasana belajar mengajar di dalam kelas yang menyenangkan bagi siswa.\r\n', '20171103-1043Untitled 1 640x480 2017-11-01 10-27-41.mp4', '20171113-teknologi.jpg', 'Alex Media', 39, 'penguasaan-media-teknologi-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36'),
(626, '1007', '8', NULL, 'Bryophyta(Tumbuhan lumut)', 'Lumut (bryophyta) adalah sebuah divisi tumbuhan yang hidup didarat, yang umumnya berwarna hijau dan berukuran kecil (dapat tidak tampak dengan bantuan lensa), dan ukuran lumut yang terbesar adalah kurang dari 50 cm.', '20171103-1007Untitled 9 960x540 2017-11-01 12-05-30.mp4', '20171103-th.jpg', 'PLANTAEA', 61, 'bryophytatumbuhan-lumut-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36'),
(627, '66', '10', NULL, 'Ubadari', 'Ubadari adalah sebuah obyek wisata alam berupa air  terjun yang terletak di kabupaten Fakfak, Papua Barat. Air terjun Ubadari termasuk air terjun tipe Kaskade.', '20171103-66Ubadari 960x540 2017-11-02 09-12-12.mp4', '20171103-IMG_20171103_083528.jpg', 'Air terjun, Kaskade,', 82, 'ubadari', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36'),
(628, '1010', '12', NULL, 'Kingdom animalia', 'ingdom Animalia atau biasa disebut hewan merupakan organisme eukariotik (organisme dengan sel kompleks)  yang multiseluler. Berbeda dengan tumbuhan, hewan tidak memiliki klorofil sehingga tidak dapat melakukan fotosintesis untuk membuat makanannya sendiri. Oleh karena itu, hewan harus mencari makanannya sendiri untuk mendapatkan energi  kemudian makanan tersebut dicerna di dalam tubuhnya. Proses ini membutuhkan oksigen dan mengeluarkan karbon dioksida sebagai zat sisa.', '20171103-1010kingdom animalia 1280x720 3,78Mbps 2017-11-01 10-55-08.mp4', '20171113-animalia.jpg', '', 28, 'kingdom-animalia', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36'),
(629, '1099', '15', NULL, 'Uji Kandungan Glukosa Pada Urine 2', 'Jika urine mengalami perubahan warna merah bata maka urine mengandung glukosa', '20171103-1099uji kandungan glukosa pada urine 640x360 0,94Mbps 2017-11-03 10-19-20(0).mp4', '20171103-foto bu eni.jpg', 'Uji Urine', 9, 'uji-kandungan-glukosa-pada-urine-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36'),
(630, '1093', '8', NULL, 'Stop Bullying', 'Bullying adalah penggunaan kekerasan, ancaman, atau paksaan untuk menyalahgunakan atau mengintimidasi orang lain. Perilaku ini dapat menjadi suatu kebiasaan dan melibatkan ketidakseimbangan kekuasaan sosial atau fisik. Hal ini dapat mencakup pelecehan secara lisan atau ancaman, kekerasan fisik atau paksaan dan dapat diarahkan berulang kali terhadap korban tertentu, mungkin atas dasar ras, agama, gender, seksualitas, atau kemampuan. Tindakan penindasan terdiri atas empat jenis, yaitu secara emosional, fisik, verbal, dan cyber. Budaya penindasan dapat berkembang di mana saja selagi terjadi interaksi antar manusia, dari mulai di sekolah, tempat kerja, rumah tangga, dan lingkungan', '20171103-1093Stop Bullying 3 960x540 2,13Mbps 2017-11-02 17-11-36.mp4', '20171113-bulying.jpg', 'bullying, stop bullying', 42, 'stop-bullying', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36'),
(631, '1099', '10', NULL, 'Uji Amilum', 'Untuk mengetahui  bahan makanan yang mengandung AMILUM bisa kita gunakan larutan LUGOL.\r\nKita teteskan larutan LUGOL pada bahan makanan yang akan diuji dan langsung terlihat perubahan warna menjadi BIRU TUA', '20171103-1099Uji Amilum 960x540 2,13Mbps 2017-11-03 17-27-10.mp4', '20171104-tempe.jpg', 'Uji Amilum', 44, 'uji-amilum', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36'),
(632, '1035', '7', NULL, 'Cake Brownis', 'Cake Brownis\r\nBrownis diperkirakan berasal dari Amerika Serikat. Brownis di kenal sebagai cake panggang yang kaya akan coklat. Lalu beberapa waktu kemudian resepnya dimodifikasi lagi dengan penambahan telur.\r\nSekarang brownis suda di modifikasi menjadi bermacam - macam rasa dengan penambahan bahan seperti keju,strawberry,bluberry,kacang,kopi danll.\r\nAwalnya ada seorang koki yang lupa untuj memasukan baking powder kedalam adonan. Sehingga brownis tersebut tidak mengembang seperti kue lainnya.\r\nNama Brownis di ambil dari \r\nThe deep brown color of cook', '20171103-1035VID-20171103-WA0004.mp4', '20171113-brouwnis.jpg', 'Widati ali abas Asal mula Cake Brownis SMP Yapis 1 Fakfak', 32, 'cake-brownis', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-03 14:25:36', '2017-11-03 14:25:36'),
(633, '1089', '13', NULL, 'Lingkungan', 'Lingkungan dibedakan menjadi 2 yaitu lingkungan alam dan lingkungan buatan. \r\nLingkungan alam contohnya : sungai, gunung, pantai, danau, laut, hutan dll. \r\nLingkungan buatan contohnya : waduk, sawah, taman, tambak dll. ', '20171104-1089LINGKUNGAN 720x480 2017-11-02 10-28-47.mp4', '', 'Lingkungan di sekitar rumah dan sekolah. ', 11, 'lingkungan', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-04 14:25:36', '2017-11-04 14:25:36'),
(634, '1085', '9', NULL, 'CARA MEMBUAT HOMEGROUP / SHARE DATA DALAM SATU JARINGAN', 'HomeGroup adalah fasilitas yang diberikan oleh Microsoft semenjak Windows 7 yang difungsikan untuk berbagi file dan data lainnya yang terhubung dalam 1 jaringan. Berbagi file ini tentu saja tidak memerlukan koneksi internet. Yang penting adalah anda terhubung dengan 1 jaringan dengan komputer lainnya. Y\r\nMenggunakan HomeGroup di Windows 10 sangatlah mudah. Yang perlu anda persiapkan hanyalah sebuah jaringan yang terkoneksi ke semua komputer yang ingin anda bagikan. Pesan yang terakhir, pastikan komputer anda tidak terlalu jauh dengan Wireless Router, jika anda menggunakan perangkat Wireless. Karena akan berdampak pada kecepatan transfer data.', '20171104-1085CARA_MEMBUAT_HOME_GROUP_SHARE_DATA_DALAM_SATU_JARINGAN[1].mp4', '20171104-HAHAHAH.jpg', 'Aku adalah seseorang yang menyukai teknologi. Bagiku, teknologi bukan membuat manusia menjadi malas. Namun tentang bagaimana menggunakan teknologi agar kita dapat mengerjakan hal lainnya, seh', 50, 'cara-membuat-homegroup-share-data-dalam-satu-jaringan', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-04 14:25:36', '2017-11-04 14:25:36'),
