(638, '1027', '10', NULL, 'Masjid Al-Yassin Patimburak Kokas Fakfak', 'Kokas adalah salah satu distrik yang ada di Fakfak Papua Barat. Berjarak 50 km dari pusat pemerintahan Kabupaten Fakfak. Di sana terdapat sebuah masjid tertua yang dibangun pada tahun 1870 Masehi yang diberi nama Masjid Al-Yassin Patimburak. yang menjadikan masjid ini unik karena ornamen bangunannya yang merupakan gabungan dari masjid dan gereja. Karena keberadaan masjid tertua yaitu berumur 200 tahun inilah maka Fakfak terkenal dengan serambi mekahnya Papua. masjid yang kurang lebih seluas 100 meter persegi ini telah mengalami beberapa kali renovasi, namun materiil asli yang belum diganti adalah empat pilar penyangga yang terdapat di dalam majid. ', '20171104-1027VID-20171104-WA0005[1].mp4', '20171104-masjid.jpg', 'masjid al-yassin patimburak', 53, 'masjid-al-yassin-patimburak-kokas-fakfak', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-04 14:25:36', '2017-11-04 14:25:36'),
(639, '1026', '5', NULL, 'Bangun Ruang', 'Bangun ruang merupakan bangun matematika yang mempunyai volume. Bangun ruang sering juga disebut bangun tiga dimensi, karena memiliki 3 komponen utama yaitu sisi, rusuk dan titik sudut.', '20171104-1026Tak berjudul 640x360 0,94Mbps 2017-11-04 07-23-55.mp4', '20171105-bangun ruang.jpg', 'Ruang', 38, 'bangun-ruang-3', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-04 14:25:36', '2017-11-04 14:25:36'),
(640, '1000', '5', NULL, 'PHBS di Sekolah', 'Perilaku Hidup Bersih & Sehat di Sekolah (PHBS) adalah sekumpulan perilaku yang dipraktikkan oleh peserta didik, guru dan masyarakat lingkungan sekolah atas dasar kesadaran sebagai hasil pembelajaran, sehingga secara mandiri mampu mencegah penyakit, meningkatkan kesehatannya,', '20171104-1000PHBS di Sekolah 960x540 2,13Mbps 2017-11-04 14-01-03.mp4', '20171105-phbs.jpg', '', 35, 'phbs-di-sekolah', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-04 14:25:36', '2017-11-04 14:25:36'),
