(666, '1105', '9', NULL, 'Penggolongan Hewan Berdasarkan Jenis Makanannya', 'Video ini berisi tentang penggolongan jenis hewan berdasarkan jenis makanannya yang terdiri dari, herbivora, karnivora, dan omnivora. Selain itu juga terdapat ciri - ciri dari jenis hewan tersebut.', '20171107-1105penggolongan hewan berdasarkan jenis makanannya.mp4', NULL, '#penggolonganjenishewan #herbivora #karnivora #omnivora #makanannya', 7, 'penggolongan-hewan-berdasarkan-jenis-makanannya-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-07 14:25:36', '2017-11-07 14:25:36'),
(667, '1105', '9', NULL, 'Penggolongan Hewan Berdasarkan Jenis Makanannya', 'hewan menurut jenis makanannya terdiri dari 3 jenis :\r\nHerbivora   : Herbivora adalah hewan pemakan tumbuhan. contohnya adalah Kelinci, sapi, dan panda.\r\nKarnivora   : Karnivora adalah hewan pemakan daging. Contohnya adalah harimau, ikan hiu, dan buaya.\r\nOmnivora   : Omnivora adalah hewan pemakan daging dan tumbuhan. Contohnya adalah monyet, ayam, dan tikus', '20171107-1105penggolongan hewan berdasarkan jenis makanannya.mp4', '20171107-cover jadi.jpg', '#penggolonganjenishewan #herbivora #karnivora #omnivora #makanannya', 119, 'penggolongan-hewan-berdasarkan-jenis-makanannya-3', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-07 14:25:36', '2017-11-07 14:25:36'),
