(710, '1007', '9', NULL, 'Chordata', 'Chordata adalah kelompok hewan, termasuk vertebrata dan beberapa binatang yang mirip invertebrata yang memiliki ciri-ciri yang serupa. Semua anggota kelompok ini, pada suatu saat dalam kehidupan mereka, memiliki notokorda, tali saraf dorsal berongga, celah faring (pharyngeal slits), endostyle, dan ekor berotot yang melewati anus. ', '20171113-1007Untitled 800x480 2017-11-12 03-41-08.mp4', '20171113-images.jpg', '', 42, 'chordata', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-13 14:25:36', '2017-11-13 14:25:36'),
