(712, '1007', '5', NULL, 'FUNGI(TUMBUHAN JAMUR)', 'Fungi adalah nama regnum dari sekelompok besar makhluk hidup eukariotik heterotrof yang mencerna makanannya di luar tubuh lalu menyerap molekul nutrisi ke dalam sel-selnya. Kalangan ilmuwan kerap menggunakan istilah cendawan sebagai sinonim bagi Fungi.', '20171113-1007VID-20171113-WA0022[1].mp4', '20171113-jamur.jpg', '', 44, 'fungitumbuhan-jamur', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-13 14:25:36', '2017-11-13 14:25:36'),
(713, '1010', '6', NULL, 'cnidaria', 'Kingdom Animalia atau biasa disebut hewan merupakan organisme eukariotik (organisme dengan sel kompleks)  yang multiseluler. Berbeda dengan tumbuhan, hewan tidak memiliki klorofil sehingga tidak dapat melakukan fotosintesis untuk membuat makanannya sendiri. Oleh karena itu, hewan harus mencari makanannya sendiri untuk mendapatkan energi  kemudian makanan tersebut dicerna di dalam tubuhnya. Proses ini membutuhkan oksigen dan mengeluarkan karbon dioksida sebagai zat sisa.\r\n\r\nCiri khas pada hewan yaitu sel hewan tidak memiliki dinding sel. Hewan banyak mengandung sel otot untuk pergerakannya dan sel saraf yang berfungsi untuk merespon setiap rangsang.\r\n', '20171113-1010VID-20171113-WA0014[1].mp4', '20171113-is (1).jpg', '', 33, 'cnidaria-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-13 14:25:36', '2017-11-13 14:25:36'),
(714, '1010', '2', NULL, 'animalia', 'Kingdom Animalia atau biasa disebut hewan merupakan organisme eukariotik (organisme dengan sel kompleks)  yang multiseluler. Berbeda dengan tumbuhan, hewan tidak memiliki klorofil sehingga tidak dapat melakukan fotosintesis untuk membuat makanannya sendiri. Oleh karena itu, hewan harus mencari makanannya sendiri untuk mendapatkan energi  kemudian makanan tersebut dicerna di dalam tubuhnya. Proses ini membutuhkan oksigen dan mengeluarkan karbon dioksida sebagai zat sisa.\r\n\r\nCiri khas pada hewan yaitu sel hewan tidak memiliki dinding sel. Hewan banyak mengandung sel otot untuk pergerakannya dan sel saraf yang berfungsi untuk merespon setiap rangsang.\r\n', '20171113-1010animals_1280x720_3,78Mbps_2017-11-13_09-57-43[1].mp4', '20171113-animalia.jpg', '', 36, 'animalia', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-13 14:25:36', '2017-11-13 14:25:36'),
