(717, '1007', '12', NULL, 'pteridophyta(Tumbuhan paku)', 'Tumbuhan paku, paku-pakuan, atau pakis-pakisan adalah sekelompok tumbuhan dengan sistem pembuluh sejati (Tracheophyta) tetapi tidak pernah menghasilkan biji untuk reproduksi seksualnya. Alih-alih biji, kelompok tumbuhan ini melepaskan spora sebagai alat penyebarluasan dan perbanyakannya, menyerupai kelompok organisme seperti lumut dan fungi.', '20171113-1007Untitled_2_640x360_2017-11-13_15-40-08[1].mp4', '20171113-pakis.jpg', '', 40, 'pteridophytatumbuhan-paku', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-13 14:25:36', '2017-11-13 14:25:36'),
(718, '1096', '13', NULL, 'Bagian-Bagian Tumbuhan dan Fungsinya', 'Bagian-bagian tumbuhan adalah akar, batang, daun dan bunga. \r\na. Fungsi Akar: Menyerap air dan zat hara dari dalam tanah ke tumbuhan, memperkokoh tegaknya tumbuhan, sebagai alat pernafasan pada \r\n                         lentisel, menyimpan cadangan makanan pada makanan tertentu\r\nb. Fungsi batang: sebgai penopang tegaknya tumbuhan, menyalurkan zat hara dar akar ke bagian tumbuhan, menyimpan cadangan makanan \r\n                             (tanaman tertentu)\r\nc. Fungsi Daun: sebagai tempat fotosintesis atau memasak makanan pada tumbuhan, sebagai alat pernafasan pada stomata/ mulut daun\r\nd. Fungsi Bunga: sebagai alat perkembangbiakan\r\n', '20171114-1096Pembelajaran_IPA_tumbuhan_Kelas_IV.mp4', NULL, '', 24, 'bagian-bagian-tumbuhan-dan-fungsinya', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-14 14:25:36', '2017-11-14 14:25:36'),
