(721, '1084', '5', NULL, 'EKSTRAKURIKULER SDN UNGARAN 01', 'Ekstrakulikuler Tari adalah salah satu dari 19 ekstrakulikuler yang ada di SDN Ungaran 01.\r\nDiikuti oleh kelas 1 sampai kelas 5 yang memilih dan dilaksanakan setiap hari Jumat sore.\r\nAdanya ekstra Tari bertujuan untuk melestarikan Budaya Daerah khususnya Jawa Tengah dengan tari klasik dan kreasinya..juga untuk membentuk karakter anak menjadi lembut,rendah hati dan tidak sombong.\r\nHasil dari ekstra tari SDN Ungaran 01 telah meraih beberapa kejuaraan dalam even-even Pekan Seni Kab dan FLS2N .\r\nDengan ekstra Tari juga akhirnya dapat mengantarkan SDN Ungaran 01 mejadi juara 1 lomba SEKOLAH BERBUDAYA MUTU tingkat NASIONAL th 2017 dalam kategori Sekolah Rujukan dan Komponen EKSTRAKULIKULER.\r\n', '20171114-1084EKSTRAKURIKULER SD N UNGARAN 01.mp4', '20171114-ekskul.jpg', 'Endang Sulistyo Dewi,S.Pd SD N Ungaran 01', 43, 'ekstrakurikuler-sdn-ungaran-01', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-14 14:25:36', '2017-11-14 14:25:36'),
