(731, '1341', '2', NULL, 'Sejarah singkat candi kalicilik', 'Sejarah singkat Candi Kalicilik yang berada di Dusun Candirejo, Desa Candirejo, Kecamatan Ponggok, Kabupaten Blitar, dapat melalui jalan utama Pare  Blitar, lurus ke arah timur sejauh lebih kurang 2 kilometer menuju kantor Desa Candirejo.\r\n\r\nCandi ini tersusun dari bata dan batu andesit. Dari angka tahun pada pintu masuk candi 1271 Saka (1349 Masehi) kita dapat mengetahui bahwa Candi Kalicilik merupakan peninggalan jaman Majapahit, khususnya pada masa pemerintahan Tribhuwanatunggadewi. Hanya sampai saat ini belum diketahui fungsi Candi Kalicilik sebagai pendharmaan siapa mengingat dalam Negarakrtagama maupun prasasti tidak pernah menyebutkannya.\r\n\r\nMenurut Agus Aris Munandar dalam makalahnya yang disampaikan dalam Seminar Naskah Kuno Nusantara sebagai Warisan Bernilai Luhur dalam rangka memperingati seperempat abad Perpustakaan Nasional Republik Indonesia mengatakan dalam kitab Negarakrtagama pupuh XL bait 5 ri sakasyabdi rudra karma kalahaniran mantuk ingswargaloka, kyating rat sang dinarmma dwaya ri kagnangan/sewaboddeng usana artinya, pada tahun 1149 Saka (1227 Masehi) dia berpulang ke sorgaloka, meninggalkan dunia. Dia didharmakan di dua tempat di Kagnangan sebagai Siwa dan sebagai Budha di Usana. Isi bait ini merupakan tempat pendharmaan tokoh Ken Angrok pendiri dinasti Rajasa yang keturunannya memerintah di Kerajaan Singasari dan Majapahit. Selain dalam kitab Negarakrtagama juga disebutkan dalam kitab Pararaton pupuh XV bait 25 ri linanira sang amurwabhumi I saka 1169 sira dhinameng kagenengan artinya sang amurwabhumi (Ken Angrok) mangkat pada tahun 1169 Saka (1247 Masehi) dia didharmakan di Kagenengan. Mengenai Kagnangan/Kagenengan sebagai pendharmaan Ken Angrok sebagai Siwa ataupun pendharmaannya di Usana sebagai Budha hinggga saat ini belum dapat diketahui keberadaannya secara pasti. Di wilayah Blitar terdapat bangunan candi bata yang dinamakan oleh penduduk sekarang dengan Candi Kalicilik. Berdasarkan temuan arca Agastya dapat diketahui bahwa Candi Kalicilik bernafaskan agama Hindu-Siwa. Di bagian depan ambang pintu masuk terpahat angka tahun 1271 Saka (1349 Masehi) sehingga diperkirakan Candi Kalicilik berasal dari masa Majapahit. Menurut Raffles dalam History of Java menyebut Candi Kalicilik ini dengan nama Candi Genengan (Raffles, 2008:382). Selain itu Agus Aris Munandar mengatakan bahwa kemungkinan Kagenengan tempat pendharmaan Ken Angrok adalah Candi Kalicilik, sedangkan angka tahun yang terdapat pada ambang pintu masuk yang menunjukkan masa Majapahit mungkin merupakan angka tahun peringatan terhadap peringatan perbaikan atau pemugaran dari bangunan yang telah ada sebelumnya dari masa Singasari (Munandar, 2005: 3-4).', '20171114-1341Sejarah Singkat Candi Kalicilik Blitar Jawa Timur.mp4', '20171115-Screenshot_2017-11-15-07-06-04-075_com.wEnsiklomedia_5388722.png', 'Rendy_wahyu_saputra absen_31 kelas_XITSM2 mapel_sejarah_indonesia. Guru_NANANG_EKO_YULISTYAWAN', 61, 'sejarah-singkat-candi-kalicilik', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-14 14:25:36', '2017-11-14 14:25:36'),
