(740, '818', '4', NULL, 'Sejarah Singkat Indische Partij', 'Indische Parti adalah sebuah organisasi masa pergerakan kebangsaan yang pertama kali berhaluan politik, sehingga ia menjadi partai pertama Indonesia yang bersifat radikal dan nonkooperatif dengan kolonial Belanda. Partai ini dibentuk oleh Tiga Serangkai (Ernest Dowes Dekker, Cipto Mangunkusumo dan Ki Hajar Dewantara) pada tanggal 25 Desember 1912.', '20171115-818AcehLora.mp4', '20171115-Lora.jpg', 'Sejarah Singkat Indische Partij', 70, 'sejarah-singkat-indische-partij', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-15 14:25:36', '2017-11-15 14:25:36'),
