(748, '1192', '4', NULL, 'Sejarah singkat berdirinya candi borobudur', 'Candi borobudur adalah sebuah candi buddha yang terletak di borobudur, magelang, jawa tengah. Candi borobudur didirikan oleh para penganut agama buddha mahayana sekitar abad ke-8 M, pada pemerintahan wangsa syailendra, yang di arsiteki oleh gunadharma. Penamaan candi borobudur pertama kali ditulis dalam buku \"SEJARAH PULAU JAWA\" karya sir thomas raffles. Kata borobudur di ambil dari kata BARA dan BUDUR, BARA yang artinya kompleks candi atau BIARA, sedangkan BUDUR berasal dari kaya BEDUHUR yang artinya atas, dengan demikian borobudur berarti \"BIARA DI ATAS BUKIT\".\r\nCandi borobudur memiliki ukiran yaitu:\r\n-luas dasar 123123 meter\r\n-tinggi asli 42 meter\r\n-tinggi setelah direnovasi 35 meter.', '20171119-1192Sejarah indonesia.mp4', '20171124-borobudur.jpg', 'XI TSM 2, SMK NEGERI 2 PURWODADI', 105, 'sejarah-singkat-berdirinya-candi-borobudur-4', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-19 14:25:37', '2017-11-19 14:25:37'),
