(750, '1308', '1', NULL, 'SEJARAH SUMPAH PEMUDA DI INDONESIA', 'Sumpah pemuda dilaksanakan pada tanggal 28 oktober 1928 \r\nIsi sumpah pemuda:\r\n1. Kami putra putri indonesia bertanah air satu,tanah indonesia\r\n2.kami putra putri indonesia berbangsa satu,bangsa indonesia\r\n3.kami putra putri indonesia berbahasa satu,bahasa indonesia.', '20171121-1308Sejarah sumpah pemuda 640x360 0,94Mbps 2017-11-21 05-50-33.mp4', NULL, '', 4, 'sejarah-sumpah-pemuda-di-indonesia-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-21 14:25:37', '2017-11-21 14:25:37'),
(751, '1270', '12', NULL, 'LATAR BELAKANG SUMPAH PEMUDA', 'Vidio ini menjelaskan singkat tentang perjuangan pemuda-pemuda republik Indonesia,untuk mempersatukan bangsa Indonesia...', '20171121-1270LATAR BELAKANG SUMPAH PEMUDA 640x360 0,94Mbps 2017-11-20 20-17-55.mp4', '20171121-images_1511166853511.jpg', 'SMK NEGERI 2 PURWODADI ', 14, 'latar-belakang-sumpah-pemuda', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-21 14:25:37', '2017-11-21 14:25:37'),
(752, '1010', '3', NULL, 'annelida', ' Annelida adalah kelompok hewan dengan bentuk tubuh seperti susunan cincin, gelang-gelang atau ruas-ruas. Istilah kata Annelida berasal dari bahasa Yunani dari kata annulus yang berarti cincin, dan oidos yang berarti bentuk. Annelida merupakan cacing dengan tubuh bersegmen, tripoblastik dengan rongga tubuh sejati (hewan selomata) dan bernapas melalui kulitnya. Terdapat sekitar 15.000 spesies annelida dengan panjang tubuh mulai dari 1 mm-3 m. Filum Annelida hidup di air tawar, air laut, dan di tanah. Umumnya annelida hidup secara bebas, meskipun ada yang bersifat parasit.  \r\n', '20171121-1010annelida_1280x720_3,78Mbps_2017-11-21_16-13-15[1].mp4', '20171121-annelida.jpg', '', 37, 'annelida', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-21 14:25:37', '2017-11-21 14:25:37'),
(753, '1010', '4', NULL, 'mollusca', 'Mollusca adalah kelompok hewan yang bersifat tripoblastik slomata dan invertebrata yang bertubuh lunak dan multiseluler. Istilah Mollusca berasal dari bahasa Yunani dari kata molluscus yang berarti lunak. Mollusca termasuk dalam hewan yang lunak baik yang dengan cangkang ataupun tanpa cangkang. Seperti dari berbagai jenis kerang-kerangan, siput, kiton, dan cumi-cumi serta kerabatanya. Mollusca merupakan filum yang terbesar kedua dari kerajaan binatang (Animalia) setelah filum Arthropoda. Pada saat ini, diperkirakan terdapat 75 ribu jenis, dengan ditambah 35 ribu jenis yang dalam bentuk posil. Molluska hidup di air laut, air tawar, payau, dan darat. Habitat Mollusca dapat berada di palung benua laut sampai pegunungan yang tinggi, dan bahkan dapat ditemukan dengan mudah di sekitar rumah kita. Molluska dipelajari pada cabang zoologi yang disebut dengan malakologi (malacology)', '20171121-1010mollusca1_1280x720_3,78Mbps_2017-11-21_15-57-20[1].mp4', '20171121-moluska.jpg', '', 55, 'mollusca', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-21 14:25:37', '2017-11-21 14:25:37'),
