(773, '1010', '7', NULL, 'Coelenterata', 'Coelenterata (Cnidaria) adalah hewan invertebrata yang mempunyai rongga dengan bentuk tubuh seperti tabung dan mulut yang dikelilingi oleh tentakel.  Pada saat berenang, mulut coelenterata menghadap ke dasar laut. Tubuh Coelenterata (hewan berongga) adalah terdiri atas jaringan luar (eksoderm) dan jaringan dalam (endoderm) serta sistem otot yang membujur dan menyilang (mesoglea). Istilah Coelenterata berasal dari bahasa Yunani dari kata Coeles yang berarti rongga dan interon yang berarti usus. Funggsi rongga tubuh pada Coelenterata adalah sebagai alat pencernaan (gastrovaskuler).\r\n\r\nCoelenterata lebih dikenal dengan sebutan Cnidaria. Istilah Cnidaria berasal dari bahasa Yunan dari kata cnida yang berarti penyengat karena sesuai dengan namanya cnidaria yang memiliki sel penyengat. Sel penyengat terdapat pada tentakel yang ada disekitar mulut. Contoh Coelenterata (Hewan berongga) adalah ubur-ubur, hydra, dan anemon laut. ', '20171123-1010coelenterata1 1280x720 3,78Mbps 2017-11-23 13-59-54.mp4', '20171123-Screenshot_2017-11-23-16-16-35-875_com.android.chrome.png', '', 25, 'coelenterata', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-23 14:25:37', '2017-11-23 14:25:37'),
