(827, '1773', '9', NULL, 'Seni batik celup', 'Batik celup adalah cara membuat batik dengan cara sederhana. Adapun alat yang di gunakan :kain katun putih,wantek karet, embet, air, plasti, dan wajan. Caranya.:1.kain kita beri pola,2.kain di pola tadi di bungkus dan di ikat dgn kuat. 3.setelah diikat semua pola tadi lalu pewarnaan. 4.masukkan kain ke dalam wajan yg sdh di isi air. 5.aduk sampai rata6.angkat,buka ikatan tadi lalu jemur\r\n', '20171125-1773seni budaya Batik 640x360 0,97Mbps 2017-11-26 20-20-31.mp4', NULL, 'Seni budaya batik perlu di kenalkan pada siswa.', 6, 'seni-batik-celup', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-25 14:25:37', '2017-11-25 14:25:37'),
(828, '1773', '2', NULL, 'Seni batik celup', 'Batik celup adalah cara membuat batik sederhana. Adapun bahan : kain katun putih,wantek,ember,karet,wajan dan plastik. Caranya:1.kain di beri motif 2.bungkus motif tadi semuanya  pakai plastik dan diikat dengan kuat.3.kain di madukkan ke dalam wajan yg sudah diisi air 4.aduk sampai rata 5.angkat dan biarkan agak dingin lalu buka ikatan tadi jemur. ', '20171125-1773seni budaya Batik 640x360 0,97Mbps 2017-11-27 04-13-16.mp4', '20171126-celup.jpg', 'Pelajaran seni budaya \"batik celup\".', 35, 'seni-batik-celup-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-25 14:25:37', '2017-11-25 14:25:37'),
