(835, '1010', '8', NULL, 'Platyhelminthe', 'Platyhelminthes adalah kelompok cacing yang tubuhnya berbentuk pipih. Secara bahasa platyhelminthes berasal dari dua kata bahasa yunani , yaitu Platy yang artinya pipih dan helmin yang artinya cacing. Platyheminthes biasanya hidup bebas di laut atau di air tawar, adapula yang hidupnya parasit. Cacing ini kebanyakan bersifat hemafrodit, yaitu memiliki dua kelamin, jantan dan betina, dalam satu tubuh. Namun demikian mereka tetap melakukan perkawinan antara 2 individu. Platyhelmintes tidak memiliki sistem pernapasan dan sistem peredaran darah. Sistem pencernaannya tidak sempurna, karena mereka belum mempunyai anus.', '20171127-1010platythelmintes 1280x720 3,78Mbps 2017-11-27 08-04-51.mp4', '20171127-20171127-08-50-07-9k=.jpg', '', 24, 'platyhelminthe', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(836, '1010', '8', NULL, 'Nemathelminthes', 'Nemathelminthes merupakan kelompok hewan cacing yang memiliki tubuh bulat panjang dengan ujung yang runcing. Secara bahasa, Kata Nemathelminthes berasal dari bahasa yunani, yaitu Nema yang artinya benang, dan helmintes yang artinya cacing. Nemathelminthes sudah memiliki rongga pada tubuhnya walaupun rongga tersebut bukan rongga tubuh sejati. Rongga tubuh pada Nemathelminthes disebut pseudoaselomata. Cacing ini memiliki tubuh meruncing pada kedua ujung sehingga disebut cacing gilig. Ukuran tubuh Nemathelminthes umumnya miksroskopis, namun adajuga yang mencapai ukuran 1 m. Cacing Nemathelminthes kebanyakan hidup parasit pada tubuh manusia, hewan, atau tumbuhan, namun adapula yang hidup bebas. Ukuran dari cacing betina lebih besar dari cacing jantan.', '20171127-1010nemathelmintes 1280x720 3,78Mbps 2017-11-27 08-02-44.mp4', '20171127-20171127-08-49-53-Z.jpg', '', 49, 'nemathelminthes', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(837, '1007', '12', NULL, 'ascomycotina', 'Kata jamur berasal dari kata latin yakni fungi. Jamur (fungi) adalah yang sifatnya eukariotik dan tidak berklorofil.  jamur (fungi) ini reproduksi dengan secara aseksual yang menghasilkan spora, kuncup, dan fragmentasi. Sedangkan dengan secara seksual dengan zigospora, askospora, dan basidiospora. Jamur (fungi) ini hidupnya ditempat-tempat yang berlembap, air laut, air tawar, ditempat yang asam dan bersimbosis dengan ganggang yang membentuk lumut (lichenes).', '20171127-1007VID-20171127-WA0028.mp4', '20171127-au.jpg', '', 29, 'ascomycotina', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(838, '1007', '8', NULL, 'myxomycotina', 'Jamur lendir atau Myxomycota adalah sekelompok protista yang berpenampilan mirip jamur namun berperilaku menyerupai amoeba[1]. Myxomycota berasal dari kata myxo yang artinya lendir, dan mykes yang artinya cendawan[1].\r\n\r\nCiri umum myxomycota adalah memiliki fase soma berupa plasmodium[1]. Plasmodium yang mengering membentuk sklerotium[1]. Fase reproduktifnya berupa sporangium yang berisi miksospora[1]. Dinding sel sporangium disebut peridium[1].\r\n\r\nHabitat cendawan ini adalah di tempat yang lembap, kayu busuk, daun mati, dan benda organik lainnya[2].', '20171127-1007VID-20171127-WA0044[1].mp4', '20171127-20171127-rt.jpg', '', 26, 'myxomycotina', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(839, '1737', '11', NULL, 'Musikalisasi Puisi_Hujan Bulan Juni_Sapardi Djoko Damono', 'Musikalisasi puisi merupakan salah satu materi pembelajaran Bahasa Indonesia kelas VIII kurikulum 2013', '20171127-1737Hujan Bulan Juni_hengipratya_fix.mp4', '', '', 19, 'musikalisasi-puisihujan-bulan-junisapardi-djoko-damono', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(840, '1007', '5', NULL, 'basidiomycotina', 'Basidiomycota adalah divisio dalam Kerajaan (Regnum) Fungi (cendawan) yang mencakup semua spesies yang memproduksi spora dalam tubuh berbentuk kotak yang disebut basidium. Basidiomycotina dibagi menjadi Homobasidimycotina (jamur yang sebenarnya); dan Heterobasidiomycetes. Basidimycotina dapat dibagi lagi menjadi tiga kelas: Hymenomycotina (Hymenomycetes), Ustilaginomycotina (Ustilaginomycetes), dan Teliomycotina (Urediniomycetes).\r\n\r\nBasidimycotina mempunyai bentuk uniseluler dan multiseluler dan dapat bereproduksi secara generatif dan vegetatif. Habitat mereka ada di terrestrial dan akuatik dan bisa dikarakteristikan dengan melihat basidia, mempunyai dikaryon.', '20171127-1007VID-20171127-WA0026[1].mp4', '20171127-20171127-122.jpg', '', 24, 'basidiomycotina', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(841, '1007', '3', NULL, 'zygomycotina', 'adalah cendawan yang dicirikan dengan hifa yang tidak bersekat-sekat (aseptae) pada kondisi normal/vegetatif. Cendawan ini bersifat coenocytic (selnya berinti banyak) dan dapat membentuk struktur dorman bersifat sementara yang disebut zigospora.[1] Dalam klasifikasi lama, Zygomycota dimasukkan bersama-sama Mastigomycota ke dalam kelas Phycomycetes (\"jamur ganggang\") berdasarkan ciri khasnya itu, tetapi ternyata keduanya kemudian diketahui menunjukkan banyak ciri yang berlainan, seperti tempat hidup dan banyaknya flagel pada tahap zoospora sehingga ditempatkan secara terpisah.[1]', '20171127-1007VID-20171127-WA0045[1].mp4', '20171127-20171127-Phycomyces.JPG', '', 21, 'zygomycotina', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(842, '1007', '1', NULL, 'cetacea(ikan paus)', 'Paus purba berevolusi pada pertengahan tempo Eocene, kira-kira 50 juta tahun yang lalu. Salah satu paus terawal yang telah punah adalah Basilosaurus yang mempunyai kepala kecil bermoncong menonjol dan bergigi. Basilosaurus mempunyai panjang 25 meter.\r\n\r\nFosil menunjukkan bahwa paus berasal dari hewan daratan berkuku, kemungkinan dari hewan seperti Mesonychid (hewan seperti serigala yang tinggal di pesisir pantai) yang berangsur-angsur kembali menghunii lautan sekitar 50 juta tahun yang lalu. Satu lagi kemungkinan hewan lain yang berubah menjadi paus, adalah Ambulocetus, mamalia seukuran anjing laut namun memiliki panjang 3 meter seberat 325 kilogram.', '20171127-1007Untitled_960x540_2017-11-27_13-31-16[1].mp4', '20171127-20171127-paus.jpg', '', 24, 'cetaceaikan-paus', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(843, '1249', '12', NULL, 'SEJARAH CANDI BOROBUDUR ', 'Candi Borobudur adalah Candi yang berada di Kecamatan Borobudur, Kabupaten Magelang. Candi Borobudur di dirikan sekitar tahun 800 Masehi. Candi Borobudur merupakan peninggalan Wangsa Syailendra yang menganut agama Budha Mahayana. Penemuan Candi Borobudur, Candi Borobudur di temukan oleh Sir Thomas Stamford Rafles ia menemukan di bawah timbunan tanah. Sir Thomas termasuk penemu pertama Candi Borobudur. ', '20171127-1249SEJARAH CANDI BOROBUDUR 640x360 0,94Mbps 2017-11-27 12-29-11.mp4', '20171127-Screenshot_2017-11-28-04-51-46-082_com.android.chrome.png', '', 34, 'sejarah-candi-borobudur', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
(844, '1786', '8', NULL, 'Sejarah candhi cetho ,M. Daimulhuda_XI_TSM2_SMK_N_2_PURWODADI', 'Candi cetho ialah salah satu candi yg ada di pulau jawa, kita sebagai generasi bangsa harus menjaga dan melestarikannya karena bangunan itu ialah warisan budaya yg jangan sampai hilang di telan zaman.......', '20171127-1786CANDI CETHO 640x480 1,26Mbps 2017-11-23 12-05-44.mp4', '20171127-Screenshot_2017-11-28-04-50-03-310_com.android.chrome.png', 'Candi_Cetho_karanganyar', 22, 'sejarah-candhi-cetho-m-daimulhudaxitsm2smkn2purwodadi', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-27 14:25:37', '2017-11-27 14:25:37'),
