(852, '1351', '12', NULL, 'Sejarah Kerajaan Tarumanegara', 'Sejarah lengkap KERAJAAN TARUMANEGARA\r\nIndonesia merupakan negara dengan sejarah yang panjang, dan salah satu sejarah panjang yang tercatat dalam sejarah adalah sejarah mengenai kerajaan-kerajaan. baik itu kerajaan Hindu-Budha maupun kerajaan islam yang turut meramaikan catatan sejarah masa lalu. dan salah satu sejarah kerajaan Hindu-Budha yang tercatat adalah kerajaan Tarumanegara, yang sebagaimana akan saya jelaskan dibawah ini.\r\n\r\nPENGANTAR :\r\nKerajaan Tarumanegara adalah salah satu kerajaan tertua di Indonesia (kedua setelah Kerajaan Kutai) dan kerajaan tertua di Jawa Barat (sunda) yang meninggalkan catatan sejarah. Tarumanegara berkuasa dari abad ke 4 sampai abad ke 7 Masehi. Dari catatan sejarah dan artefak yang ditinggalkan. Kerajaan Tarumanegara merupakan kerajaan yang beralirkan Hindu.\r\nTarumanegara didirikan oleh Rajadirajaguru Jayasingawarman pada tahun 358 M (naskah wangsakerta). Kerajaan Tarumanegara merupakan kelanjutan dari kerajaan Salakanegara (130-362 M). Pada saat berdirinya kerajaan Tarumanegara,ibukota kerajaan berpindah dari Rajatapura (ibukota Salakanegara) ke Tarumanegara. Salakanegara menjadi kerajaan daerah.\r\n\r\nLETAK :\r\n\r\n\r\n\r\nKerajaan Tarumanegara terletak di daerah kerajaan Salakanegara tepatnya di daerah Banten dan Bogor (Jawa Barat) yang beribukota di Sundapura (Purnawarman 397M). Wilayah kekuasaan Tarumanegara menurut prasasti Tugu (417 M) meliputi daerah Banten,Jakarta,Bogor dan Cirebon.\r\n\r\nNAMA RAJA-RAJA YANG MEMERINTAH :\r\nJayasingawarman (358-382 M)\r\n Jayasingawarman adalah pendiri Kerajaan Tarumanagara yang memerintah antara 358  382. Ia adalah seorang maharesi dari Salankayana di India yang mengungsi ke Nusantara karena daerahnya diserang dan ditaklukkan Maharaja Samudragupta dari Kerajaan Magada. Ia adalah menantu Raja Dewawarman VIII dan dipusarakan di tepi kali Gomati (Bekasi).\r\nPada masa kekuasaannya, pusat pemerintahan beralih dari Rajatapura ke Tarumangara. RAJATAPURA atau SALAKANEGARA (kota Perak), yang disebut Argyre oleh Ptolemeus dalam tahun 150, terletak di daerah Teluk Lada, Pandeglang. Kota ini sampai tahun 362 menjadi pusat pemerintahan raja-raja Dewawarman (dari Dewawarman I - VIII).\r\n\r\nDharmayawarman (382-395 M)\r\nDharmayawarman adalah raja kedua Kerajaan Tarumanagara yang memerintah antara 382  395. Ia adalah anak dari Jayasingawarman. Ia dipusarakan di tepi kali Candrabaga. Namanya hanya tercantum dalam Naskah Wangsakerta.\r\n\r\nPurnawarman (395-434 M)\r\nPurnawarman (Purnavarmman) adalah raja yang tertera pada beberapa prasasti pada abad V. Ia menjadi raja di Kerajaan Tarumanagara. Ia mengidentifikasikan dirinya dengan Wisnu.\r\nDi Naskah Wangsakerta, Purnawarman adalah raja ketiga Kerajaan Tarumanagara yang memerintah antara 395  434. Ia membangun ibu kota kerajaan baru dalam tahun 397 yang terletak lebih dekat ke pantai dan dinamainya \"Sundapura\". Nama Sunda mulai digunakan oleh Maharaja Purnawarman dalam tahun 397 untuk menyebut ibu kota kerajaan yang didirikannya.\r\nDi naskah Wangsakerta juga disebutkan bahwa di bawah kekuasaan Purnawarman terdapat 48 raja daerah yang membentang dari Salakanagara atau Rajatapura (di daerah Teluk Lada, Pandeglang) sampai ke Purwalingga (sekarang Purbalingga) di Jawa Tengah. [1] Secara tradisional Cipamali (Kali Brebes) memang dianggap batas kekuasaan raja-raja penguasa Jawa Barat pada masa silam.\r\n\r\nWisnuwarman (434-455 M)\r\nIndrawarman (455-515 M)\r\nCandrawarman (515-535 M)\r\nSuryawarman (535-561 M)\r\n\r\nSuryawarman (meninggal 561) ialah raja Kerajaan Tarumanagara yang ketujuh. Setelah ayahnya Candrawarman yang meninggal pada tahun 535 dan memerintah selama 26 tahun antara tahun-tahun 535 - 561.\r\nSuryawarman tidak hanya melanjutkan kebijakan politik ayahnya yang memberikan kepercayaan lebih banyak kepada raja daerah untuk mengurus pemerintahan sendiri, melainkan juga mengalihkan perhatiannya ke daerah bagian timur. Pada tahun 526 M, misalnya, Manikmaya, menantu Suryawarman, mendirikan kerajaan baru di Kendan, daerah Nagreg antara Bandung dan Limbangan, Garut.', '20171128-1351Tak berjudul 3 960x540 2,13Mbps 2017-11-27 11-41-24.mp4', '20171128-tarumanegara.jpg', 'Feri Setyawan, SMKN 2 PURWODADI, XI TSM 2', 31, 'sejarah-kerajaan-tarumanegara', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(853, '1342', '8', NULL, 'Sejarah Candi Gedungsongo', 'Sejarah Candi Gedong Songo Semarang\r\nSejarah Candi Gedong Songo Semarang. Candi Gedong Songo merupakan sebuah kompleks percandian peninggalan Hindu. Lokasi Candi Gedong Songo ada di Desa Candi, Kecamatan Bandungan, Jawa Tengah dengan koordinat -7.210290, +110.342010.\r\n\r\nLetaknya yang berada di ketinggian 1.200 mdpl tepat di kaki Gunung Ungaran membuat suhu udara di kawasan candi menjadi sangat sejuk yaitu sekitar 19 - 27 Celcius. Mungkin kondisinya sangat mirip dengan di atau Candi Cetho.\r\n\r\nSitus candi ini berada pada jarak sekitar 15 kilometer dari kota sejuk Ambarawa dan sangat mudah untuk dicapai. Dari kota semarang hanya berjarak sekitar 45 kilometer saja. Sedangkan untuk menuju kompleks candi ini kita juga akan sekaligus melewati obyek wisata Bandungan yang berada tepat di bawah komplek candi, berjarak sekitar 10 menit.\r\n\r\n\r\nSejarah Candi Gedong Songo Semarang Masih Sebuah Misteri \r\n\r\nSampai dengan saat ini para ahli arkeologi belum dapat menemukan satupun bukti sejarah candi gedong songo mengenai tahun pembangunan kompleks Candi Gedong Songo berikut latar belakang pembangunannya. Namun dilihat dari bentuk arsitektur dan lokasinya, bisa diprediksi bahwa kompleks candi ini dibuat pada masa pemerintahan dinasti Sanjaya Hindu di Jawa yaitu sekitar abad ke-8.\r\n\r\nLetak candi yang berada di perbukitan juga menunjukkan fungsinya yaitu sebagai tempat untuk pemujaan. Karena menurut kepercayaan Hindu pada masa itu, gunung dianggap sebagai kahyangan atau surga tempat para dewa. Selain itu kesimpulan tersebut juga bisa diambil dari ciri bentuk bangunan yang sangat mirip dengan kompleks Candi Dieng.\r\n\r\n\r\nSejarah Candi Gedong Songo Semarang\r\n\r\nSejarah Candi Gedong Songo diawali pada tahun 1740 oleh Sir Thomas Stamford Raffles yang mengungkapkan. Pada saat itu Raffles hanya menemukan 7 buah bangunan candi sehingga dia menyebutnya dengan Candi Gedong Pitu, pitu dalam bahasa Jawa berarti tujuh.\r\n\r\nVan Stein Callenfels seorang arkeolog dari Belanda pada tahun 1908  1911 melakukan penelitian di lokasi kompleks candi ini dan kemudian menemukan juga 2 bangunan candi lain, sehingga total candi yang ditemukan menjadi 9 buah. Dengan ditemukannya 2 candi lain ini, maka lalu nama Gedong Pitu berubah nama menjadi Gedong Sanga.\r\n\r\nPada tahun 1928  1929 dilakukan pemugaran terhadap Candi Gedong I dan Candi Gedong II. Sedangkan pemerintah Indonesia sendiri melakukan pemugaran total terhadap Candi Gedong Songo antara tahun 1972  1982.', '20171128-1342Tak berjudul 2 960x540 2,13Mbps 2017-11-25 10-57-55.mp4', '20171128-gedongsongo1.jpg', 'Farul Setiawan, SMKN 2 PURWODADI, XI TSM 2', 38, 'sejarah-candi-gedungsongo', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
