(863, '1764', '12', NULL, 'Tata Krama (SMAN 2 Tebo)', 'Tata krama  telah menjadi bahan dalam kehidupan bermasyarakat dan menjadi persyaratan dalam hidup sehari-hari, malahan menjadi meningkat dan sangat berperan untuk memudahkan manusia diterima di masyarakatnya. Pada waktu anda masih kanak-kanak, secara tidak sadar orang tua anda telah melatih anda agar menerima pemberian orang dengan tangan kanan,lalu mengucapkan terima kasih.\r\n\r\nTata krama adalah kebiasaan. Kebiasaan ini merupakan tata cara yang lahir dalam hubungan antar manusia. Kebiasaan ini muncul karena adanya aksi dan reaksi dalam pergaulan. Sebagai contoh, kalau orang indonesia setuju dengan apa yang dikemukakan ia akan mengangguk- anggukan kepalanya. Sebaliknya di negeri lain ada yang menyatakan setuju dengan menggeleng-gelengkan kepalanya.', '20171128-1764Tata Krama.mp4', '20171128-tata.jpg', '', 29, 'tata-krama-sman-2-tebo', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
