(865, '1740', '1', NULL, 'ZAT ADITIF (SMP N 13 TEBO )', 'Zat aditif merupakan bahan yang ditambahkan kedalam makanan baik pada saat memproses ,mengolah, mengemas,menyimpan makanan dan sering juga pada minuman.tujuannya adalah untuk memberi aroma,warna,mengawetkan serta ketertarikan terhadap makanan.\r\n      Zat aditif dibagi menjadi dua:\r\n1.Zat aditif alami contoh daun pandan,wortel,cabai,gula tebu,kunyit buah murbei dan lainnya.\r\n2.Zat aditf buatan contohnya garam,MSG,dinatrium,tartrazine,natrium nitrit,sakarin dan lainnya.', '20171128-1740Zat Aditif 640x480 1,26Mbps 2017-11-25 12-07-34.mp4', '20171128-aditif.jpg', '', 69, 'zat-aditif-smp-n-13-tebo', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(866, '1376', '2', NULL, 'SEJARAH KERAJAAN DEMAK', 'Kerajaan Demak\r\n     Kerajaan Demak merupakan kerajaan Islam pertama di Pulau Jawa. Kerajaan ini didirikan oleh Raden Patah pada tahun 1500 hingga tahun 1550. Raden Patah adalah putra dari Prabu Brawijaya Sebagai kerajaan Islam pertama di pulau Jawa, Kerajaan Demak sangat berperan besar dalam proses Islamisasi pada masa itu. Kerajaan Demak berkembang sebagai  pusat perdagangan dan sebagai pusat penyebaran agama Islam. Wilayah kekuasaan Demak meliputi Jepara, Tuban, Sedayu Palembang, Jambi dan beberapa daerah di Kalimantan. Di samping itu, Kerajaan Demak  juga memiliki pelabuhan-pelabuhan penting seperti Jepara, Tuban, Sedayu, Jaratan dan Gresik yang berkembang menjadi pelabuhan transito (penghubung).           \r\n\r\n    Dalam masa pemerintahan Raden Patah, Demak berhasil dalam berbagai bidang, diantaranya adalah perluasan dan pertahanan kerajaan, pengembangan Islam dan pengamalannya, serta penerapan musyawarah dan kerja sama antara ulama dan umara (penguasa). Keberhasilan Raden Patah dalam perluasan dan pertahanan kerajaan dapat dilihat ketika ia menaklukkan Girindra Wardhana yang merebut tahkta Majapahit (1478), hingga dapat menggambil alih kekuasaan majapahit. Selain itu, Raden Patah juga mengadakan perlawan terhadap Portugis, yang telah menduduki Malaka dan ingin mengganggu Demak. Ia mengutus pasukan di bawah pimpinan putranya, Pati Unus atau Adipati Yunus atau Pangeran Sabrang Lor (1511), meski akhirnya gagal. Perjuangan Raden Patah kemudian dilanjutkan oleh Pati Unus yang menggantikan ayahnya pada tahun 1518. Dalam bidang dakwah Islam dan pengembangannya, Raden Patah mencoba menerapkan hukum Islam dalam berbagai aspek kehidupan. Selain itu, ia juga membangun istana dan mendirikan masjid (1479) yang sampai sekarang terkenal dengan masjid Agung Demak. Pendirian masjid itu dibantu sepenuhnya oleh walisanga. \r\n \r\nLukisan Masjid Agung Demak th 1801\r\n    Pada tahun 1518 Raden Patah wafat kemudian digantikan putranya yaitu Pati Unus. Pati Unus terkenal sebagai panglima perang yang gagah berani dan pernah memimpin perlawanan terhadap Portugis di Malaka. Karena keberaniannya itulah ia mendapatkan julukan Pangeran Sabrang Lor. Armada perang Islam siap berangkat dari pelabuhan Demak dengan mendapat pemberkatan dari Para Wali yang dipimpin oleh Sunan Gunung Jati. Dipimpin langsung oleh Pati Unus bergelar Senapati Sarjawala yang telah menjadi Sultan Demak II. Dari sini sejarah keluarga beliau akan berubah, sejarah kesultanan Demak akan berubah dan sejarah tanah Jawa akan berubah. Kapal yang ditumpangi Pati Unus terkena peluru meriam ketika akan menurunkan perahu untuk merapat ke pantai. Ia gugur sebagai Syahid karena kewajiban membela sesama Muslim yang tertindas penjajah (Portugis) yang bernafsu memonopoli perdagangan rempah-rempah. Pimpinan Armada Gabungan Kesultanan Banten, Demak dan Cirebon segera diambil alih oleh Fadhlullah Khan yang oleh Portugis disebut Faletehan, dan belakangan disebut Fatahillah setelah mengusir Portugis dari Sunda Kelapa 1527. Pengambil alihan ini adalah atas inisiatif Sunan Gunung Jati yang sekaligus menjadi mertua karena putri beliau yang menjadi janda Sabrang Lor dinikahkan dengan Fadhlullah Khan. \r\n\r\n    Sepeninggal Pati Unus, kerajaan Demak kemudian diperintah oleh Sultan Trenggono. Beliau memerintah Demak dari tahun 1521-1546 M. Sultan Trenggono adalah putra Raden Patah, adik dari Pati Unus. Pada tahun 1546 Sultan Trenggono menyerang Panarukan, Situbondo yang saat itu dikuasai Blambangan. Sunan Gunung Jati membantu dengan mengirimkan gabungan prajurit Cirebon, Banten, dan Jayakarta sebanyak 7.000 orang yang dipimpin Fatahillah. Pasukan Demak sudah mengepung Panarukan selama tiga bulan, tapi belum juga dapat merebut kota itu. Suatu ketika Sultan Trenggono bermusyawarah bersama para adipati untuk melancarkan serangan selanjutnya. Putra bupati Surabaya yang berusia 10 tahun menjadi pelayannya. Anak kecil itu tertarik pada jalannya rapat sehingga tidak mendengar perintah Trenggono. Trenggono marah dan memukulnya. ', '20171128-1376KERAJAAN DEMAK 640x360 0,94Mbps 2017-11-22 12-31-44.mp4', '20171128-demak.jpg', '', 35, 'sejarah-kerajaan-demak', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(867, '1771', '13', NULL, 'Metamorfosis Pada Hewan ', 'Metamorfosis adalah perubahan bentuk tubuh hewan menurut tahap tertentu. metamorfosis terbagi dua yaitu: 1.metamorfosis sempurna adalah hewan yang baru menetas berbeda bentuk dengan induknya, contoh kupu-kupu dan katak\r\n2. metamorfosis tidak sempurna adalah hewan yang baru menetas mempunyai bentuk yang mirip dengan induknya, hanya bagianj tubuh belum lengkap, contoh kecoa. ', '20171128-1771metamorfosis pada hewan ibu gus.mp4', '20171128-metamorf.jpg', '', 38, 'metamorfosis-pada-hewan', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(868, '1299', '7', NULL, 'Sejarah Candi Prambanan', 'Candi Prambanan atau Candi Roro Jonggrang adalah kompleks candi Hindu terbesar di Indonesia yang dibangun pada abad ke-9 masehi. Candi ini dipersembahkan untuk Trimurti, tiga dewa utama Hindu yaitu Brahma sebagai dewa pencipta, Wishnu sebagai dewa pemelih', '20171128-1299Tugas sejarah indonesia 640x480 1,26Mbps 2017-11-28 19-21-44.mp4', '20171128-prambanan.jpg', '', 50, 'sejarah-candi-prambanan-3', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(869, '1299', '2', NULL, 'Sejarah Candi Prambanan', 'Candi Prambanan atau Candi Roro Jonggrang adalah kompleks candi Hindu terbesar di Indonesia yang dibangun pada abad ke-9 masehi. Candi ini dipersembahkan untuk Trimurti, tiga dewa utama Hindu yaitu Brahma sebagai dewa pencipta, Wishnu sebagai dewa pemelihara, dan Siwa sebagai dewa pemusnah. Berdasarkan prasasti Siwagrha nama asli kompleks candi ini adalah Siwagrha (bahasa Sanskerta yang bermakna \'Rumah Siwa\'), dan memang di garbagriha (ruang utama) candi ini bersemayam arca Siwa Mahadewa setinggi tiga meter yang menujukkan bahwa di candi ini dewa Siwa lebih diutamakan.', '20171128-1299Tugas sejarah indonesia 640x480 1,26Mbps 2017-11-28 19-21-44.mp4', NULL, 'Dimasadi_11TITL3', 7, 'sejarah-candi-prambanan-4', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(870, '1780', '7', NULL, 'INDAHNYA KEBERSAMAAN, TEMATIK KELAS IV', 'Keberagaman Indonesia tercermin pada rumah adat. Kita harus mensyukuri keberagaman dan keindahan rumah adat.', '20171128-1780INDAHNYA KEBERSAMAAN. 1280x720 3,78Mbps 2017-11-27 22-12-07.mp4', '20171128-Screenshot_2017-11-28-23-26-59-917_com.android.chrome.png', 'Dengan adanya keberagaman membuat kita kaya dengan pengetahuan.', 29, 'indahnya-kebersamaan-tematik-kelas-iv', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(871, '1710', '7', NULL, 'Sejarah Keraton Surakarta', 'Sejarah Singkat Karaton Surakarta Hadiningrat. Keraton Surakarta atau lengkapnya dalam bahasa Jawa disebut Karaton Surakarta Hadiningrat adalah istana Kasunanan Surakarta. ... Istana ini pula menjadi saksi bisu penyerahan kedaulatan Kerajaan Mataram oleh Sunan PB II kepada VOC pada tahun 1749.', '20171128-1710Tak berjudul 1 640x360 0,97Mbps 2017-11-28 19-44-26.mp4', '20171128-surakarta.jpg', 'SMK NEGERI 2 PURWODADI', 19, 'sejarah-keraton-surakarta', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(872, '1887', '6', NULL, 'Masjid Menara Kudus', 'Mesjid Menara Kudus (disebut juga dengan Masjid Al Manar (\"Mesjid Menara\", nama resmi: Masjid Al Aqsa Manarat Qudus; ID masjid: 01.5.14.19.02.000001[1]) adalah masjid kuno yang dibangun oleh Sunan Kudus sejak tahun 1549 Masehi (956 Hijriah). Lokasi saat ini berada di Desa Kauman, Kecamatan Kota, Kabupaten Kudus, Jawa Tengah. Ada keunikan dari masjid ini karena memiliki menara yang serupa bangunan candi serta pola arsitektur yang memadukan konsep budaya Islam dengan budaya Hindu-Buddhis sehingga menunjukkan terjadinya proses akulturasi dalam pengislaman Jawa.', '20171128-1887Tugas_sejarah_Indonesia_salin_640x360_0,94Mbps_2017-11-28_10-31-39[1].mp4', '20171128-Screenshot_2017-11-28-23-10-49-819_com.android.chrome.png', 'SMK NEGERI 2 PURWODADI', 43, 'masjid-menara-kudus', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
(873, '1889', '13', NULL, 'Sejarah Kerajaan Kutai', 'Kutai Martadipura adalah kerajaan bercorak Hindu di Nusantara yang memiliki bukti sejarah tertua. Berdiri sekitar abad ke-4. Kerajaan ini terletak di Muara Kaman, Kalimantan Timur, tepatnya di hulu sungai Mahakam. Nama Kutai diberikan oleh para ahli mengambil dari nama tempat ditemukannya prasasti yang menunjukkan eksistensi kerajaan tersebut. Tidak ada prasasti yang secara jelas menyebutkan nama kerajaan ini dan memang sangat sedikit informasi yang dapat diperoleh.', '20171128-1889Sejarah_Kerajaan_Kutai_640x360_0,94Mbps_2017-11-28_23-29-16[1].mp4', '20171128-Screenshot_2017-11-29-04-11-01-916_com.android.chrome.png', 'SMK NEGERI 2 PURWODADI', 40, 'sejarah-kerajaan-kutai-4', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-28 14:25:37', '2017-11-28 14:25:37'),
