(876, '1844', '5', NULL, 'Korosi Pada Besi', 'Korosi adalah peristiwa perusakan logam oleh karena terjadinya reaksi kimia antara logam dengan senyawa senyawa di lingkungannya membentuk senyawa yang tidak dikehendaki.\r\n\r\nContoh peristiwa korosi antara lain karat pada besi, pudarnya warna mengkilap pada perak, dan munculnya warna kehijauan pada tembaga.\r\n\r\nKorosi dapat dicegah dengan beberapa cara, diantaranya:\r\n1. Pengecatan\r\n2. Melumuri dengan oli atau minyak\r\n3. Galvanisasi', '20171129-1844korosi besi 1280x720 2017-11-29 00-00-42.mp4', '20171129-20171129-Screenshot_20171129_083707.png', '', 50, 'korosi-pada-besi', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-29 14:25:37', '2017-11-29 14:25:37'),
