(892, '1369', '2', NULL, 'Sejarah kedatangan voc di Indonesia', 'Sejarah Kedatangan Belanda dan Berdirinya VOC\r\nIndonesia adalah merupakan negara yang kaya sumber daya alam. Hal ini membuat banyak bangsa lain di penjuru dunia datang ke Indonesia untuk mencari bahan rempah-rempah. Mereka yang datang ke Indonesiakebanyakan para pelaut dan pedagang dari negara-negara di Eropa. Para pedagang yang awalnya hanya berniat berdagang saja dengan penduduk Indonesia, kemudian berubah niatnya menjadi ingin menguasai bangsa Indonesia. ', '20171129-1369kedatangan voc di indonesia 640x360 0,94Mbps 2017-11-29 10-46-41.mp4', '20171129-voc.jpg', '', 36, 'sejarah-kedatangan-voc-di-indonesia', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-29 14:25:37', '2017-11-29 14:25:37'),
