(913, '1296', '3', NULL, 'Peristiwa 10 november 1945, di kota surabaya', 'Peristiwa 10 November ditandai dengan adanya balas dendam sekutu ( inggris ) karena terbunuhnya Brigadir Jenderal Mallaby, pemimpin Negara sekutu ( inggris ) tepatnya dijembatan merah, Surabaya.\r\nPeristiwa 10 November ini menewaskan 6.000 pejuang Indonesia dan 200.000 rakyat sipil mengungsi darikota Surabaya. Karena banyaknya korban tersebut, akhirnya kota Surabaya dikenang sebagai Kota Pahlawan pada tanggal 10 November .', '20171129-1296PERISTIWA 10 NOVEMBER DI SURABAYA 640x360 0,94Mbps 2017-11-29 15-45-28.mp4', '20171129-10nov.jpg', '', 49, 'peristiwa-10-november-1945-di-kota-surabaya', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-29 14:25:37', '2017-11-29 14:25:37'),
