(915, '1296', '12', NULL, 'Peristiwa 10 november 1945, di kota surabaya', 'Peristiwa 10 November ditandai dengan adanya balas dendam sekutu ( inggris ) karena terbunuhnya Brigadir Jenderal Mallaby, pemimpin Negara sekutu ( inggris ) tepatnya dijembatan merah, Surabaya.\r\nPeristiwa 10 November ini menewaskan 6.000 pejuang Indonesia dan 200.000 rakyat sipil mengungsi darikota Surabaya. Karena banyaknya korban tersebut, akhirnya kota Surabaya dikenang sebagai Kota Pahlawan pada tanggal 10 November .\r\n', '20171129-1296PERISTIWA 10 NOVEMBER DI SURABAYA 640x360 0,94Mbps 2017-11-29 15-45-28.mp4', '20171129-Screenshot_2017-11-21-10-45-44-49.png', '', 3, 'peristiwa-10-november-1945-di-kota-surabaya-2', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-29 14:25:37', '2017-11-29 14:25:37'),
(916, '1754', '7', NULL, 'Menggunakan Disk CleanUp pada Sistem Operasi Windows 7', 'Fasilitas Disk CleanUp adalah fasilitas yang digunakan untuk membersihkan file-file yang sampah yang sudah tidak diperlukan lagi pada komputer kita.', '20171129-1754Menggunakan Disk CleanUp. Win. 7.mp4', '20171129-Screenshot_2017-11-29-20-39-45-740_com.android.chrome.png', '', 25, 'menggunakan-disk-cleanup-pada-sistem-operasi-windows-7', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-29 14:25:37', '2017-11-29 14:25:37'),
(917, '1293', '2', NULL, 'Candi budha di pulau jawa ', 'Candi Borobudur, tingginya mencapai 42 meter, juga merupakan candi Mahayana, terletak di Magelang, utara Yogyakarta. Borobudur berasal dari katabara dan budur. Bara berasal dari kata wihara atau biara dari Sansekerta yang berarti kuil atau asrama. Sedangkan budur diperkirakan berasal dari kata beduhur yang artinya di atas. Jadi, Borobudur dapat diartikan sebagai biara yang ada di atas bukit. Candi ini didirikan sekitar tahun 800-an M atas perintah raja-raja Mataram dari Dinasti Syailendra.\r\n\r\nBentuk dasar candi ini adalah punden berundak-undak, namun disesuaikan dengan filosofi Buddha Mahayana. Borobudur bersusun tiga tingkat, yaitu kamadhatu, rupadhatu, dan arupadhatu dengan relief sepanjang 4 km dan arca Buddha berjumlah lebih dari 500 buah. Pada seluruh dinding Borobudur, terdapat sebelas seri relief yang memuat kurang-lebih dari 1.460 buah adegan.\r\n\r\nRelief-relief tersebut memuat berbagai kisah: cerita Buddha, surga dan neraka, dan kisah-kisah dari kitab yang terkenal seperti cerita Karmawibhangga. Namun, sebagian relief lain masih belum dapat diartikan ceritanya. Di atas puncak Borobudur ini terdapat sebuah stupa yang paling besar. Di setiap stupa terdapat patung Budha dalam berbagai posisi.', '20171129-1293Tak berjudul 640x360 0,94Mbps 2017-11-29 13-39-40.mp4', '20171129-Screenshot_2017-11-29-20-38-35-105_com.android.chrome.png', '', 25, 'candi-budha-di-pulau-jawa', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-29 14:25:37', '2017-11-29 14:25:37'),
