(944, '1954', '3', NULL, 'sejarah masjid agung banten', 'Masjid Agung Banten terletak di Kompleks bangunan masjid di Desa Banten Lama, Kecamatan Kasemen, sekitar 10 km sebelah utara Kota Serang. Masjid ini dibangun pertama kali oleh Sultan Maulana Hasanuddin (1552-1570), sultan pertama Kesultanan Demak. Ia adalah putra pertama Sunan Gunung Jati. Salah satu khasa yang tampak dari masjid ini  adalah atap bangunan utama yang bertumpuk lima, mirip pagoda China. Ini adalah karya arsitekturChina yang bernama Tjek Ban Tjut. Dua buah serambi yang0pq dibangun kemudian menjadi pelengkap di sisi utara dan selatan bangunan utama', '20171130-1954sejarah masjid agung banten 640x360 0,94Mbps 2017-11-30 10-50-19.mp4', '20171130-banten.jpg', '', 23, 'sejarah-masjid-agung-banten', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-30 14:25:37', '2017-11-30 14:25:37'),
