(968, '1768', '2', NULL, 'tolak peluru teknik O brine\'s', 'memprektekkan teknik tolakan dengan teknik O brine\'s atau membelakangi pada nomor tolak peluru,yang mana ini merupakan salah satu teknik yang di pakai selain dari teknik gaya ortodok(menyamping).adapun langkah pelaksanaannya di awali dengan teknik memegang peluru,teknik meletakkan peluru pada bahu dan menempelkan di leher,teknik menolak peluru, agar mendapatkan hasil maksimal di harapkan melaksanakan secara berulang dengan teknik dan langkah yang benar.untuk mengindari kemungkinan cidera agar dapat melakukan peregangan dan pemanasan  terlebih dahulu  .semoga bermanfaat', '20171130-1768tolak_peluru_menggunakan__teknik__obirnes_640x360_0,94Mbps_2017-11-29_16-53-[1].mp4', '20171130-Screenshot_2017-11-30-22-25-26-688_com.android.chrome.png', 'ensiklomedia.tve.kemdikbud.go.id', 35, 'tolak-peluru-teknik-o-brines', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-11-30 14:25:37', '2017-11-30 14:25:37'),
