(1149, '2054', '9', NULL, 'CARA MEMBUAT PELANGI', 'Pelangi atau Rainbow merupakan fenomena optik dan meteorologi berupa cahaya warna-warni paralel satu sama lain di langit atau media lainnya. \r\nDi langit, pelangi tampak sebagai busur cahaya dengan ujungnya mengarah ke cakrawala pada saat hujan ringan. Rainbow juga dapat dilihat di sekitar air terjun mengamuk.\r\nBeberapa dari cahaya berwarna ini kemudian dipantulkan dari sisi yang jauh di tetesan air, kembali dan keluar lagi dari tetesan air. Cahaya keluar kembali dari tetesan air ke arah yang berbeda, tergantung pada warnanya. Warna pelangi dibuat dengan warna merah di atas dan ungu di bagian bawah pelangi.', '20171208-2054Tak_berjudul_640x360_0,94Mbps_2017-12-08_10-38-32[1].mp4', NULL, 'PELANGI', 8, 'cara-membuat-pelangi', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-12-08 14:25:38', '2017-12-08 14:25:38'),
