(1151, '2078', '6', NULL, 'Cara Membuat Kamera', 'kamera adalah sesuatu yang sudah tidak asing lagi bagi kita. karena perkembangan zaman yang sangat mutakhir ini kamera menjadi benda yang sering kita bawa kemana - mana. dan ternyata kita bisa membuat kamera dengan cara yang sederhana. bisa dibuat menggunakan bahan - bahan yang terdiri dari gunting, karton, penggaris, pensil dan lup ', '20171208-2078Tak berjudul 640x360 0,94Mbps 2017-12-08 09-42-23.mp4', NULL, 'Kamera', 6, 'cara-membuat-kamera-4', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-12-08 14:25:38', '2017-12-08 14:25:38'),
(1152, '2103', '2', NULL, 'CARA MEMBUAT PELANGI', 'video ini menjelaskan tentang membuat pelangi dengan cara sederhana yaitu menggunakan cahaya lampu, air dan kaca. Pelangi akan muncul jika cahaya diarahkan ke kaca yang dicelupkan ke air. Dan pelangi akan muncul pada kertas putih yang di letakkan di depan cermin.', '20171208-2103Tak berjudul 2 640x360 0,94Mbps 2017-12-08 10-36-01.mp4', NULL, 'Pelangi', 6, 'cara-membuat-pelangi-4', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-12-08 14:25:38', '2017-12-08 14:25:38'),
(1153, '2081', '8', NULL, 'Cara Membuat Pelangi', 'Pelangi tidak lain adalah busur spektrum warna besar berbentuk lingkaran yang terjadi karena pembiasan cahaya matahari oleh butir-butir air. Ketika cahaya matahari melewati butiran air, ia membias seperti ketika menembus prisma kaca dan keluar menjadi spektrum warna pelangi.\r\nWarna yang dikandung cahaya matahari, yang akan terlihat pada pelangi: merah, jingga, kuning, hijau, biru, nila, dan violet atau dikenal dengan MEJIKUHIBINIU. ... Warna-warna pada pelangi ini tersusun dengan merah di paling atas dan ungu di paling bawah pelangi.', '20171208-2081WIWIN.mp4', '20171208-Wiwin.JPG', 'Pelangi', 8, 'cara-membuat-pelangi-3', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-12-08 14:25:38', '2017-12-08 14:25:38'),
