(1189, '66', '5', NULL, 'Pesawat Buatan SMK', 'Jabiru J-430 SMKN 12 Bandung\r\nSTM Penerbangan atau yang kini dikenal dengan SMK Negeri 12 Bandung yang beralamat di Jalan Pajajaran No 92 Bandung menggebrak dunia SMK yang kini sedang marak-maraknya menghasilkan sebuah karya dari Program Studi Terkait. Setelah sukses dalam Pameran Epitech  6 JABAR 2011 yang diselenggarakan di SMKN 2 Tasikmalaya dengan menarik perhatian lebih dari seribu pengunjung. Kini SMKN 12 Bandung  mendapatkan banyak perhatian atas hasil karyanya yaitu merakit pesawat terbang. Pesawat rakitan sekolah yang dulu bernama STM Penerbangan Bandung itu diberi nama Jabiru atau J-430. Kami punya pesawat Jabiru buatan SMK 12 yang sudah jadi dan sudah dipamerkan, kata Kepala Dinas Pendidikan Jawa Barat Wahyudin Zarkashy, di Bandung.\r\n\r\nPesawat Terbang yang berhasil dirakit siswa siswi SMKN 12 Bandung ini merupakan tipe pesawat kecil berkapasitas empat sampai enam orang penumpang. Biaya untuk proses ini didapatkan dari bantuan Kepala PSMK Pusat yang ada di Jakarta. Pesawat ini dapat berfungsi  untuk kegiatan pertanian, yakni penyiraman tanaman, penyemprotan pupuk, dan pengusiran hama. Sasaran pesawat Jabiru adalah daerah-daerah terpencil di Indonesia. Jadi konsep pesawat yang dikembangkan sesuai dengan kepulauan, kata Wahyudin. \r\n\r\nSaat ini pesawat yang bisa dirakit SMKN 12 Bandung masih satu unit. Namun rencananya akan diproduksi secara massal dan dipasarkan secara nasional karena dipastikan akan sanagt dibutuhkan oleh petani masa depan dalam proses pertanian agar semakin efisien. Nantinya, para petani masa depan akan mendapat pelayanan seperti di Australia. Nah, kita sisipkan anak-anak SMK supaya bisa merancang dan merawat pesawat-pesawat itu, tuturnya.\r\n\r\nJika dibandingkan dengan harga pesawat  pasar internasional  di Australia, pesawat Jabiru dengan tipe sejenis dijual dengan harga empat milliar. Namun SMKN 12 Bandung hanya menghabiskan dana sebesar satu milliar untuk satu unitnya. Maka dengan demikian, potensi pasar yang ada akan sangat menjanjikan.Tentunya Pemerintah harus memberikan dukungan agar karya anak bangsa yang satu ini dapat berkembang dan pada akhirnya akan memunculkan karya-karya lain.', '20171211-66jabiru_x264.mp4', '20171211-jabiru.jpg', 'pesawat, SMKN, ', 41, 'pesawat-buatan-smk', NULL, NULL, NULL, NULL, NULL, '0000-00-00 00:00:00', NULL, '2017-12-11 14:25:38', '2017-12-11 14:25:38'),
